(1, 'အတည်ပြုလူနာစုစုပေါင်း (၁၇၀,၀၀၀)ကျော်အထိရှိလာတဲ့ ကိုဗစ်တတိယလှိုင်း', '<p>ဇူလိုင် (၅) ရက် ည (၈) နာရီမှ ဇူလိုင် (၆) ရက် ည (၈)နာရီအထိ ဓာတ်ခွဲနမူနာ (၁၂၈၃၂) ခု စစ်ဆေးခဲ့ပြီး COVID-19 ရောဂါ ဓာတ်ခွဲအတည်ပြုလူနာ (၃၆၀၂) ဦး တွေ့ရှိခဲ့ပြီး (၅၂) ဦး ထပ်မံသေဆုံးကြောင်း  ကျန်းမာရေးနှင့် အားကစားဝန်ကြီးဌာန၏ ည (၈) နာရီ သတင်းထုတ်ပြန်ချက်အရ သိရသည်။<br></p>', 'e1d6f7da27559c5aad81b3d07ddad5c4.jpg', 1, 1, '2021-07-09', 'July,9,2021'),
(2, 'ဗဟုသုတမျှဝေခြင်း', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=\"removed\"><div dir=\"auto\" xss=\"removed\"><div dir=\"auto\" xss=\"removed\">လူတွေရဲ့အိတ်ထဲက ပိုက်ဆံကိုလိုချင်ရင်..... </div><div dir=\"auto\" xss=\"removed\"> ♦လူတွေရဲ့အိတ်ထဲကပိုက်ဆံကိုလိုချင်ရင် ခင်ဗျား ပစ္စည်း (သို့မဟုတ်) ၀န်ဆောင်မှုတစ်ခုခုကိုရောင်း ရပါလိမ့်မယ်။ နောက်ပြီးတော့ လူတွေက ခင်ဗျားစီက ပစ္စည်းတွေ၊ ၀န်ဆောင်မှုတွေကိုဘာ့ကြောင့် ၀ယ်ရတာလဲ ဆိုတာ သေချာသိဖို့လိုပါတယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦လူတွေက အကြောင်း အရင်း(၂)မျိုးကြောင့် ၀ယ်ပါတယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦နံပတ် (၁) က Needs ဆိုတဲ့ အရှိမဖြစ်လိုအပ်ချက် ကြောင့်ဖြစ်တယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦နံပတ် (၂) ကတော့ Wants ဆိုတဲ့ လိုချင်စိတ်ကြောင့် ဖြစ်တယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦ဥပမာ (၁) ဘိုက်ဆာလို့ အစာစားတယ်။ ဒါက Needs ကိုဖြည့်ဆည်းတာ။ သို့သော် ဘာစားမှာလဲ? ကြေးအိုးမှ စားချင်တာ။ ဒံပေါက်မှစားချင်တာ။ ဒါဆို Wants ဖြစ်သွားပြီ။</div><div dir=\"auto\" xss=\"removed\"> ♦ဥပမာ (၂) ဖုန်းတစ်လုံး၀ယ်ချင်တယ်။ ဒါက သမာရိုးကျ မရှိမဖြစ်လို့ ၀ယ်တာဖြစ်တယ်။ သို့သော် Camera ကောင်းတာလေးပဲ၀ယ်ချင်တယ်။ Storage များတာလေး၀ယ်ချင်တယ်။ သို့မဟုတ် Iphone လေးကိုင်ချင်တယ်။ ဒါဆိုရင်တော့ Wants ဖြစ်သွားပြီ။</div><div dir=\"auto\" xss=\"removed\"> ♦ခင်ဗျားစျေးထဲမှာ ကြက်ဥ၊ ဘဲဥ၊ ကြက်သား၊ ၀က်သား၀ယ်ရင် စျေးဆစ်ချင်ဆစ်လိမ့်မယ်။ အပိုတွေလည်းတောင်းခဲ့ဖူးလိမ့်မယ်။ ခင်ဗျား Iphone ၀ယ်လို့ရှိရင်စျေးမဆစ်ဘူး။ တန်တယ်လို့တောင် ထင်ရင်ထင်နေမယ်။ သူနဲ့ပတ်သက်တဲ့ Accessories တွေလည်း အကုန်လုံးခင်ဗျား၀ယ်လိမ့်မယ်။</div><div dir=\"auto\" xss=\"removed\">♦ ကျွန်တော်လည်း ဒီလိုပဲ။ စျေးထဲမှာ ကန်စွန်းရွက် တစ်စီး ၃၀၀ဆိုရင် ၂စီး ၅၀၀ ရမလားလို့စျေးဆစ် မိတတ်တယ်။ ဒါက Needs အတွက်၀ယ်တာနော်.. ဟော.. ကိုယ့်အတွက် LV ခါးပတ် $1000 ၀န်းကျင် (ဆယ်သိန်းကျော်)ကျတော့စျေးမဆစ်တော့ဘူး။ အံမယ်.... တန်လိုက်တာလို့တောင် ထင်မိတယ်။ ဒါက Wants လို့ခေါ်တယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦အဲ့တော့ ခင်ဗျား ပိုက်ဆံပိုလိုချင်ရင် လူတွေရဲ့ Wants တွေကိုသိပြီး Wants ကိုရောင်းပေးနိုင်ဖို့လိုတယ်။ လူတွေရဲ့ ဆိုက်ကိုအရ Needs အတွက်ဆိုရင် ပိုက်ဆံ သိပ်မပေးချင်ဘူးဗျ။ Wants ဆိုရင်တော့ ပိုက်ဆံတွေ အများကြီးပေးချင်တယ်။ ပေးရတာလဲ တန်တယ်လို့ သူတို့စိတ်ထဲမှာတင်မိတယ်။ အဲ့လိုထင်အောင်လုပ်ရတဲ့ မဟာဗျူဟာတွေလည်း ရှိတယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦လောကမှာ Needs ကိုရောင်းနေတဲ့သူတွေက အများကြီးရှိတယ်။ ယှဉ်ပြိုင်ထိုး ဖောက်ဖို့မလွယ်ဘူး။ ပိုက်ဆံလည်းထင်သလောက်မရဘူး။အဲ့တော့ တစ်ခုခု ဆိုရင် ခင်ဗျားစျေးလျှော့ရောင်းဖို့ချည်းပဲ မစဉ်းစားနဲ့။ Customers တွေရဲ့ Wants တွေကိုသိအောင်လုပ်ပြီး သူတို့အတွက် Value Creation များများသာလုပ်ပေး နိုင်အောင်ကြိုးစားပါ။ သူတို့စီမှာ ၀ယ်ဖို့ပိုက်ဆံမရှိ ရင်တောင် ရှိတဲ့နေရာကနေ ပိုက်ဆံချေးပြီး ၀ယ်သုံး လိမ့်မယ်။</div><div dir=\"auto\" xss=\"removed\"> ♦Needs, Wants and Demand ကိုချိန်တက်ရင် လုပ်ငန်းတွေ မတရား အောင်မြင်ပြီးတော့ ခင်ဗျားလည်း ချမ်းသာပြီ။</div></div></div>', '6704cfaf8fc92aad5e62738aca253dea.jpg', 1, 1, '2021-07-10', 'July,10,2021'),
(3, 'စာချုပ်ချုပ်မည်ဆိုလျှင် လက်ရောက်ပေးအပ်ပါသည် ဆိုသည့်ကိစ္စ', '<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>ငှားရမ်းသည် ဖြစ်စေ၊ ပေါင်နှံသည် ဖြစ်စေ ၊ ပေးကမ်းသည် ဖြစ်စေ ၊ ရောင်းသည်ဖြစ်စေ ၊ လက်ရောက်ပေး အပ်မှုသည် ပါဝင်လာစမြဲ ဖြစ်သည်။ ဥပမာ - အရောင်းအဝယ်ပြုသည်ဆိုပါက ဝယ်သူက ငွေကို ပေးချေပြီး ရောင်းသူက ပစ္စည်းကို ပေးအပ်မည် ဖြစ်သည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>  လက်ရောက်ပေးအပ်မှုနှင့် စပ်လျဉ်း၍ ယခု တင်ပြမည့် အကြောင်း အရာသည် ရွှေ့ပြောင်းနိုင်သော ပစ္စည်း အတွက်ဖြစ်ပါမူ ပြဿနာ ပေါ်ပေါက်စရာမရှိဟု ဆိုရပါမည်။ သို့သော် မရွှေ့ပြောင်းနိုင်သော ပစ္စည်းတွင်မူ ပြဿနာရှိနိုင်သည် ဖြစ်သောကြောင့် လက်ရောက်ပေးအပ်မှုကိစ္စနှင့် ပတ်သက်၍ စာချုပ်များ ချုပ်ဆိုကြမည် ဆိုပါက သတိမူနိုင်ရန် အချက်တစ်ရပ်အနေဖြင့် တင်ပြလိုပါသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>  စာချုပ်ချုပ်ရာတွင် စာတစ်လုံး၏ တန်ဖိုး မည်မျှ ခရီးပေါက်သည်၊ မည်မျှ အရေးပါသည်ဆိုသည့် အချက်ကိုပါ တစ်ပါတည်း ဆင်ခြင်နိုင်ကြလိမ့်မည်ဟု မျှော်လင့်မိပါသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>အိမ်နှင့်မြေ အရောင်းအဝယ်ပြုလုပ်သည့် ကိစ္စတစ်ရပ်ကို နမူနာပေးတင်ပြပါမည်။ ထုံးစံအတိုင်း စရန်ငွေပေး သော သဘောတူစာချုပ်တစ်ခု ပြုလုပ်ကြပါသည်။ ငွေအပြီးပေးချေသောနေ့တွင် အပိုင်ရောင်းသူက အပိုင် ရောင်း သော အိမ်နှင့်မြေကို အပြီးလက်ရောက်ပေးအပ်ပါမည်ဟူသော သဘောတူညီချက်တစ်ရပ်ကိုလည်း စာချုပ်တွင် ထည့်သွင်း ချုပ်ဆိုကြရပါသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>     စာချုပ်ပါ သဘောတူမှုအတိုင်း အပိုင်ဝယ်ယူသူက ငွေများ အရစ်ကျပေးသွင်းလာခဲ့ရာမှ နောက်ဆုံး ကျန်ရှိ သော ရောင်းဖိုးငွေကို အပြီးအကျေ အပိုင်ရောင်းသူသို့ ပေးချေလာပါသည်။ အပိုင်ရောင်းသူကလည်း မူလ ချုပ်ဆိုခဲ့ကြသည့် သဘောတူကတိစာချုပ်တွင် ဖော်ပြပါရှိထားသည့်အတိုင်း ငွေအပြေအကျေ ပေးချေသောနေ့ တွင် အိမ်နှင့်မြေကို အပိုင် ဝယ်ယူလက်ဝယ်သို့ အပြီး လက်ရောက်ပြန်လည်း ပေးအပ်ပါသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>   အပိုင်ဝယ်ယူသူသည် လက်ရောက်ပေးအပ်ခံရသော အိမ်နှင့်မြေရှိရာသို့ သွားရောက်သောအခါ နေအိမ်တွင် လူအချို့ နေထိုင်လျက်ရှိနေသည်ကို တွေ့ရပါသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>   ဤတွင် အပိုင်ရောင်းသူနှင့် အပိုင်ဝယ်ယူတို့ ပြဿနာတက်ပါတော့ သည်။ အပိုင်ဝယ်ယူသူက အိမ်နှင့်မြေကို ၎င်းအား လက်ရောက်ပေးအပ်ခဲ့ခြင်းမရှိဟု အပိုင်ရောင်းသူအား စွပ်စွဲပါသည်။ အပိုင်ရောင်းသူကလည်း အိမ်နှင့်မြေကို အပိုင် ဝယ်ယူသူသို့ လက်ရောက်လွှဲပြောင်းပေးအပ်ပြီး ဖြစ်သည်။ ထိုသို့ လက်ရောက်လွှဲပြောင်း ပေးအပ်ခဲ့သည့် အချိန်မှအစပြု၍ ယခုအချိန်အထိ အိမ်နှင့် မြေသည် အပိုင်ဝယ်ယူသူ၏ လက်ဝယ်တွင် ရှိနေပြီ ဟုဆိုသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>   အပိုင်ရောင်းသူ၏ ထုချေချက်ဆိုလိုရင်းမှာ ၎င်းအနေနှင့် ရောင်းသော အိမ်နှင့်မြေမှ ဖယ်ရှားထွက်ခွာ ပေးခဲ့ပြီးဖြစ်ကြောင်း ၊ ထို့နောက် အပိုင်ဝယ်ယူသူသို့ အိမ်နှင့်မြေကို လက်ရောက်ပေးအပ်ခဲ့ပြီး ဖြစ်ကြောင်း၊ အိမ် နှင့်မြေတွင် လူအချို့ ကျန်ရှိခြင်းမှာ ၎င်းနှင့်မသက်ဆိုင်ကြောင်း၊ ၎င်းအနေနှင့် စာချုပ်တင် သဘောတူထား သည့်အတိုင်း လက်ရောက်ပေးအပ်ပြီးဖြစ်ကြောင်း ထုချေခြင်း ဖြစ်သည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>   နေထိုင်သူများ၏ ပြောပြချက်အရ ၎င်းတို့သည်  -- - - - - - - - - - အိမ်ငှားဖြစ်ကြောင်း သိရပါသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>        ဖော်ပြပါပြဿနာကို ပြန်လည်စမ်းစစ်ရာတွင် စာချုပ်ချုပ်စဉ်က ( ငွေကို အပြီးပေးချေချိန်တွင် အိမ်နှင့် မြေ ကို အပိုင်ဝယ်ယူသူသို့ အပြီး လက်ရောက်လွှဲပြောင်းပေးအပ်ရမည် ဖြစ်သည် ) ဟူသော နေရာတွင် ( ငွေကို အပြီးပေးချေ ချိန်တွင် အိမ်နှင့်မြေကို နေထိုင်သူမရှိ ၊ အပိုင်ဝယ်ယူသူသို့ အပြီး လက်ရောက်လွှဲပြောင်း ပေး အပ်ရမည် ဖြစ်သည် ) ဟူ၍ မဖော်ပြ မချုပ်ဆိုမိခဲ့၍ အထက်ပါ အတိုင်း ပြဿနာဖြစ်ရခြင်း ဖြစ်သည်ဟူ၍ ဆိုရ မည်ဖြစ်ပေသည်။</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>(အညွှန်း - ဦးကျော်ဇေယျ ၊ စာချုပ်ချုပ်မည်ဆိုလျှင် ဆောင်ရန်ရှောင်ရန်များ ၊ စာ ၈၇ )  ။ DVBLawLab</div></div>', '3a7a5d621c4200dcc87e8049294a521a.jpg', 1, 1, '2021-07-10', 'July,10,2021'),
(4, 'မင်္ဂလာပါ ကျတော်တို့ တက်နေဝန်းအိမ်ခြံမြေမှကြိုဆိုပါတယ်', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>မင်္ဂလာပါ ကျတော်တို့ တက်နေဝန်းအိမ်ခြံမြေမှကြိုဆိုပါတယ်</div><div dir=\"auto\" xss=removed>လူကြီးမင်းတို့၏ တန်ဖိုးရှိသော အချိန်များကို အထူးအလေးထားပြီး </div><div dir=\"auto\" xss=removed>အိမ်ခြံမြေနှင့် ပတ်သတ်သော အရောင်းအဝယ်</div><div dir=\"auto\" xss=removed>အဌား ကိစ္စရပ်များနှင့်တကွ အိမ်ခြံမြေနှင့်ပတ်သတ်သောလုပ်ငန်းဆောင်တာ ကိစ္စအဝဝကို</div><div dir=\"auto\" xss=removed>မှန်ကန်တိကျမြန်ဆန်စွာဖြင့် ဥပဒေနှင့်အညီ </div><div dir=\"auto\" xss=removed>အကျိုးဆောင်ပေးနေပါသည်ခင်ဗျာ #(unicode)</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" xss=removed><div dir=\"auto\" xss=removed>မင်္ဂလာပါ ကျတော်တို့တက်နေဝန်း အိမ်ခြံမြေမှ ကြိုဆိုပါတယ် </div><div dir=\"auto\" xss=removed>လူကြီးမင်းတို့၏ တန်ဖိုးရှိသော အချိန်များကို </div><div dir=\"auto\" xss=removed>အထူးအလေးထားပြီး </div><div dir=\"auto\" xss=removed>အိမ်ခြံမြေနှင့် ပတ်သတ်သော အရောင်းအဝယ် အငှါးကိစ္စရပ်များနှင့်တကွ အိမ်ခြံမြေနှင့်ပတ်သတ်သော လုပ်ငန်းဆောင်တာကိစ္စအဝဝကို မှန်ကန်တိကျမြန်ဆန်စွာဖြင့် ဥပဒေနှင့်အညီ အကျိုးဆောင်ပေးနေပါသည်ခင်ဗျာ #(zawgyi)</div></div>', 'c9f422d6aa4667f0566e611e93375c21.jpg', 1, 1, '2021-11-27', 'Nov,27,2021');
