(63, 'မြောက်ဒဂုံမြို့နယ် ၃၁ရပ်ကွက်ရှိ ပေ၂၀ပေ၆၀ တစ်ထပ်ပျဉ္ထောင်အိမ်ရောင်းရန်ရှိပါသည်', 'မြောက်ဒဂုံမြို့နယ် ၃၁ရပ်ကွက်ရှိ ပေ၂၀ပေ၆၀ တစ်ထပ်ပျဉ္ထောင်အိမ်ရောင်းရန်ရှိပါသည်', 1, 16, 3, '1', '20x60', 'Sqft', 700, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01342</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (31)ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ပျဉ်ထောင်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (700) ညှိနိူင်း</p><p><br></p><p>ဗန္ဓုလ(မန္တလေး)လမ်းမကြီး အနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်ပျဉ်အိမ်လေးဆိုတော့ အသင့်နေလိုသူ လူကြီးမင်းများအတွက် </p><p>အဆင်ပြေမယ့်နေရာလေးပါရှင့်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင့်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင့်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ\"်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OH01342</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (31)ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ပျဉ်ထောင်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (700) ညှိနိူင်း</p><p><br></p><p>ဗန္ဓုလ(မန္တလေး)လမ်းမကြီး အနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်ပျဉ်အိမ်လေးဆိုတော့ အသင့်နေလိုသူ လူကြီးမင်းများအတွက် </p><p>အဆင်ပြေမယ့်နေရာလေးပါရှင့်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင့်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေ