င်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000053', NULL, NULL, NULL, 0, '2021-07-23', '23 July, 2021 22:51 pm', 9, 0, '', 'No', NULL),
(73, 'မြောက်ဒဂုံမြို့နယ် ၄၈ရပ်ကွက်ရှိ ပေ၁၂၀ ပေ၁၀၀ မြေသီးသန့်ရောင်းရန်ရှိသည်', 'မြောက်ဒဂုံမြို့နယ် ၄၈ရပ်ကွက်ရှိ ပေ၁၂၀ ပေ၁၀၀ မြေသီးသန့်ရောင်းရန်ရှိသည်', 1, 16, 4, '', '40x60', 'Sqft', 3000, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AL01331</p><p>ရန်ကုန်မြို့ မြောက်ဒဂုံမြို့နယ် (48)ရပ်ကွက်</p><p>ပေ ၁၂၀ ပေ ၁၀၀ ​မြေသီးသန့်  အရောင်း </p><p>ဈေးနှုန်း  သိန်း(3000)ညှိနိူင်း</p><p><br></p><p>ပါမစ်</p><p><br></p><p>မြေသီးသန့်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကြိုက်ဆောက်ပြီးနေဖို့အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '<p>#AL01331</p><p>ရန်ကုန်မြို့ မြောက်ဒဂုံမြို့နယ် (48)ရပ်ကွက်</p><p>ပေ ၁၂၀ ပေ ၁၀၀ ​မြေသီးသန့်  အရောင်း </p><p>ဈေးနှုန်း  သိန်း(3000)ညှိနိူင်း</p><p><br></p><p>ပါမစ်</p><p><br></p><p>မြေသီးသန့်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကြိုက်ဆောက်ပြီးနေဖို့အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000054', NULL, NULL, NULL, 0, '2021-07-23', '23 July, 2021 22:54 pm', 6, 0, '', 'No', NULL),
(74, 'မြောက်ဒဂုံမြို့နယ် ၄၂ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ တစ်ထပ်RCရောင်းရန်ရှိသည် ', 'မြောက်ဒဂုံမြို့နယ် ၄၂ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ တစ်ထပ်RCရောင်းရန်ရှိသည် ', 1, 16, 3, '1', '40x60', 'Sqft', 1400, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01330</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (42)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်RC အရောင်း</p><p>ဈေးနှုန်း သိန်း (1400) ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်RCအိမ် လေးဆိုတော့  လူကြီးမင်းတို့အတွက် အသင့်​ နေဖို့</p><p>ဆင်ပြေမယ့်နေရာလေးပါရှင့်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင့်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင့်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OH01330</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (42)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်RC အရောင်း</p><p>ဈေးနှုန်း သိန်း (1400) ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်RCအိမ် လေးဆိုတော့  လူကြီးမင်းတို့အတွက် အသင့်​ နေဖို့</p><p>ဆင်ပြေမယ့်နေရာလေးပါရှင့်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင့်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လို