(86, 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက်ရှိ ပေ၂၀ပေ၆၀ ၂ထပ်BN ရောင်းရန်ရှိသည် ', 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက်ရှိ ပေ၂၀ပေ၆၀ ၂ထပ်BN ရောင်းရန်ရှိသည်', 1, 16, 3, '2', '40x60', 'Sqft', 1900, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01318</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်BNအိမ်ရောင်း</p><p>ဈေးနှုန်း သိန်း (1900) ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စု လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ်</p><p>နှစ်ထပ်BNအိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးမှာဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#AH01318</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်BNအိမ်ရောင်း</p><p>ဈေးနှုန်း သိန်း (1900) ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စု လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ်</p><p>နှစ်ထပ်BNအိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးမှာဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000067', NULL, NULL, NULL, 0, '2021-07-24', '24 July, 2021 17:01 pm', 4, 0, '', 'No', NULL),
(87, '​မြောက်ဒဂုံမြို့နယ် ၄၆ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ မြေသီးသန့်(ပျဥ္ထောင်အိမ်အဟောင်းပါ)ရောင်းရန်ရှိသည်', '​မြောက်ဒဂုံမြို့နယ် ၄၆ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ မြေသီးသန့်(ပျဥ္ထောင်အိမ်အဟောင်းပါ)ရောင်းရန်ရှိသည်', 1, 16, 4, '', '40x60', 'Sqft', 1150, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01314</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (46)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့်(ပျဥ်ထောင်အိမ်အဟောင်း) အရောင်း</p><p>ဈေးနှုန်း သိန်း (1150) ညှိနိူင်း</p><p><br></p><p>ရာဇသင်္ကြန် လမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>မြေသီးသန့် အရောင်းလေးဆိုတော့ အိမ်ဆောက်ပြီးနေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးရဲ့ အနီးမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OL01314</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (46)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့်(ပျဥ်ထောင်အိမ်အဟောင်း) အရောင်း</p><p>ဈေးနှုန်း သိန်း (1150) ညှိနိူင်း</p><p><br></p><p>ရာဇသင်္ကြန် လမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>မြေသီးသန့် အရောင်းလေးဆိုတော့ အိမ်ဆောက်ပြီးနေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးရဲ့ အနီးမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000068', NULL, NULL, NULL, 0, '2021-07-24', '24 July, 2021 17:12 pm', 5, 0, '', 'No', NULL),
