(111, 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ရှိ ပေ၄၀ပေ၆၀ ၂ထပ်2RCတိုက်ခံအိမ်ရောင်းရန်ရှိသည် ', 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ရှိ ပေ၄၀ပေ၆၀ ၂ထပ်2RCတိုက်ခံအိမ်ရောင်းရန်ရှိသည် ', 1, 16, 3, '2', '40x60', 'Sqft', 1300, 'MMK(Lakhs)', 'No', 'Fully Furnished', '1', '1', '1', '1', '2', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01293</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်2RCတိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (1300) ညှိနိူင်း</p><p><br></p><p>တပင်ရွှေထီးလမ်းမကြီးကျောကပ် နှင့် ဗန္ဓုလလမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>နှစ်ထပ်2RCတိုက်ခံအိမ် ဆိုတော့ အိမ်ဆောက်ပြီးနေလိုသူ  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးပေါ်မှာဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#AH01293</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်2RCတိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (1300) ညှိနိူင်း</p><p><br></p><p>တပင်ရွှေထီးလမ်းမကြီးကျောကပ် နှင့် ဗန္ဓုလလမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>နှစ်ထပ်2RCတိုက်ခံအိမ် ဆိုတော့ အိမ်ဆောက်ပြီးနေလိုသူ  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးပေါ်မှာဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000092', NULL, NULL, NULL, 0, '2021-07-25', '25 July, 2021 18:39 pm', 7, 0, '', 'No', NULL),
