(129, 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ၄၁ပေ ၆၀ပေ တစ်ထပ်ခွဲRCတိုက်အိမ်အသစ်အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ၄၁ပေ ၆၀ပေ တစ်ထပ်ခွဲRCတိုက်အိမ်အသစ်အရောင်း', 1, 16, 3, '2', '40x60', 'Sqft', 3950, 'MMK(Lakhs)', 'No', 'Fully Furnished', '3', '3', '2', '1', '4', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01274</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (30)ရပ်ကွက်</p><p>ပေ 41 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ခွဲRCတိုက်အိမ်အသစ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (3950) ညှိနိူင်း</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီးအနီး နှင့် </p><p><br></p><p>သခင်ဗဟိန်းလမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်ခွဲRCတိုက်အိမ်အသစ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OH01274</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (30)ရပ်ကွက်</p><p>ပေ 41 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ခွဲRCတိုက်အိမ်အသစ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (3950) ညှိနိူင်း</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီးအနီး နှင့် </p><p><br></p><p>သခင်ဗဟိန်းလမ်းမကြီးအနီး</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်ခွဲRCတိုက်အိမ်အသစ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာ