(138, 'မြောက်ဒဂုံမြို့နယ် ၂၈ရပ်ကွက်ရှိပေ၄၀ပေ၆၀ အဆောင်ရောင်းရန်ရှိသည်', 'မြောက်ဒဂုံမြို့နယ် ၂၈ရပ်ကွက်ရှိပေ၄၀ပေ၆၀ အဆောင်ရောင်းရန်ရှိသည်', 1, 16, 3, '', '40x60', 'Sqft', 3100, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<div>#AH01266</div><div>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (28)ရပ်ကွက်</div><div>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</div><div>်အဆောင်အရောင်း</div><div>ဈေးနှုန်း သိန်း(3100)ညှိနိူင်း</div><div><br></div><div>ဆရာစံလမ်းမကြီးအပေါ်</div><div><br></div><div>ဂရမ္​ </div><div><br></div><div>အဆောင်အိမ် အရောင်းလေးဆိုတော့အဆင်သင့်နေလိုသူများ အဆောင်ငှါးမဲ့  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </div><div><br></div><div>လမ်းမကြီးအနီးမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </div><div><br></div><div>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</div><div><br></div><div>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</div><div>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</div><div>အရောင်းများ</div><div>‌</div><div>လုံးခြင်းအရောင်းများစွာနှင့်</div><div>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</div><div>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</div><div><br></div><div>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</div><div>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</div><div><br></div><div>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</div><div><br></div><div>️', '<p>#AH01266</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (28)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>်အဆောင်အရောင်း</p><p>ဈေးနှုန်း သိန်း(3100)ညှိနိူင်း</p><p><br></p><p>ဆရာစံလမ်းမကြီးအပေါ်</p><p><br></p><p>ဂရမ္​ </p><p><br></p><p>အဆောင်အိမ် အရောင်းလေးဆိုတော့အဆင်သင့်နေလိုသူများ အဆောင်ငှါးမဲ့  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးမှာရှိတဲ့အတွက် ကာ