(161, 'မြောက်ဒဂုံမြို့နယ် ၃၄ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့် အိမ်အဟောင်းပါ ၂ကွက်တွဲ အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၄ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့် အိမ်အဟောင်းပါ ၂ကွက်တွဲ အရောင်း', 1, 16, 4, '', '40x60', 'Sqft', 4400, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AL01070</p><p>ရန်ကုန်မြို့ မြောက်ဒဂုံမြို့နယ် (34)ရပ်ကွက်ပေ၄၀ပေ၆၀ အကျယ်အဝန်းရှိသော ​</p><p>မြေသီးသန့်(အိမ်​ဟောင်းပါ) နှစ်ကွက်တွဲ</p><p>အရောင်း</p><p>ဈေးနှုန်း  သိန်း(4400)ညှိနိူင်း</p><p><br></p><p>ပင်လုံလမ်းမအနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကြိုက်ဆောက်ပြီးနေဖို့အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '<p>#AL01070</p><p>ရန်ကုန်မြို့ မြောက်ဒဂုံမြို့နယ် (34)ရပ်ကွက်ပေ၄၀ပေ၆၀ အကျယ်အဝန်းရှိသော ​</p><p>မြေသီးသန့်(အိမ်​ဟောင်းပါ) နှစ်ကွက်တွဲ</p><p>အရောင်း</p><p>ဈေးနှုန်း  သိန်း(4400)ညှိနိူင်း</p><p><br></p><p>ပင်လုံလမ်းမအနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကြိုက်ဆောက်ပြီးနေဖို့အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ