(164, 'မြောက်ဒဂုံမြို့နယ် ၂၈ရပ်ကွကရှိ ၄၉ပေ ၆၀ပေ တစ်ထပ်တိုက် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၂၈ရပ်ကွကရှိ ၄၉ပေ ၆၀ပေ တစ်ထပ်တိုက် အရောင်', 1, 16, 3, '1', '40x60', 'Sqft', 2200, 'MMK(Lakhs)', 'No', 'Fully Furnished', '1', '', '1', '1', '', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01241</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (28)ရပ်ကွက်</p><p>ပေ 49 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(2200)ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စု လမ်းမကြီးအနီး  </p><p><br></p><p>ဆရာစံ လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်တိုက်ခံအိမ် အရောင်းလေးဆိုတော့အဆင်သင့်နေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးနှစ်ခုမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OH01241</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (28)ရပ်ကွက်</p><p>ပေ 49 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(2200)ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စု လမ်းမကြီးအနီး  </p><p><br></p><p>ဆရာစံ လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်တိုက်ခံအိမ် အရောင်းလေးဆိုတော့အဆင်သင့်နေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးနှစ်ခုမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000145', NULL, NULL, NULL, 0, '2021-07-26', '26 July, 2021 15:34 pm', 5, 0, '', 'No', NULL),
(165, 'မြောက်ဒဂုံမြို့နယ် ၃၈ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ ၁ထပ်တိုက်ခံအိမ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၈ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ ၁ထပ်တိုက်ခံအိမ် အရောင်', 1, 16, 3, '1', '40x60', 'Sqft', 4300, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '1', '1', '1', '', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01240</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (38)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(4300)ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စု လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်တိုက်ခံအိမ် (အဟောင်း)အရောင်းလေးဆိုတော့ အိမ်ဆောက်ပြီးနေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေသလို လမ်းမကြီးပေါ်မှာဆိုတော့ စီးပွားရေးလုပ်မယ့် လူကြီးမင်းတို့အတွက်လဲ အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးပေါ်မှာဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OH01240</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (38)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(4300)ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စု လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်တိုက်ခံအိမ် (အဟောင်း)အရောင်းလေးဆိုတော့ အိမ်ဆောက်ပြီးနေလိုသူ လူကြီးမင်းတို့အတွက် အဆင်ပြေသလို လမ်းမကြီးပေါ်မှာဆိုတော့ စီးပွားရေးလုပ်မယ့် လူကြီးမင်းတို့အတွက်လဲ အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးပေါ်မှာဆိုတော့ ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000146', NULL, NULL, NULL, 0, '2021-07-26', '26 July, 2021 15:36 pm', 4, 0, '', 'No', NULL),
(166, 'မြောက်ဒဂုံမြို့နယ် ၃၈ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ ပျဥ္ထောင်အိမ်၂လုံး အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၈ရပ်ကွက်ရှိ ပေ၄၀ပေ၆၀ ပျဥ္ထောင်အိမ်၂လုံး အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 2000, 'MMK(Lakhs)', 'No', 'Fully Furnished', '1', '1', '1', '1', '2', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01237</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (38)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>ပျဥ်ထောင်အိမ်နှစ်လုံး အရောင်း</p><p>ဈေးနှုန်း သိန်း(2000)ညှိနိူင်း</p><p><br></p><p>မန္တလေး(ဗန္ဓုလ) လမ်းမကြီးပေါ်</p><p><br></p><p>ဂရမ်</p><p><br></p><p>ပျဥ်​ေထာင်အိမ်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့အသင့်နေဖို့ အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး​ေပါ်မှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#AH01237</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (38)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>ပျဥ်ထောင်အိမ်နှစ်လုံး အရောင်း</p><p>ဈေးနှုန်း သိန်း(2000)ညှိနိူင်း</p><p><br></p><p>မန္တလေး(ဗန္ဓုလ) လမ်းမကြီးပေါ်</p><p><br></p><p>ဂရမ်</p><p><br></p><p>ပျဥ်​ေထာင်အိမ်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့အသင့်နေဖို့ အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး​ေပါ်မှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေး