(190, 'မြောက်ဒဂုံမြို့နယ် ၄၅ရပ်ကွက် ပေ၄၀ပေ၆၀ ၃ထပ်ခွဲRCတိုက်အိမ်အသစ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၅ရပ်ကွက် ပေ၄၀ပေ၆၀ ၃ထပ်ခွဲRCတိုက်အိမ်အသစ် အရောင်း', 1, 16, 3, '3', '40x60', 'Sqft', 2850, 'MMK(Lakhs)', 'No', 'Fully Furnished', '3', '4', '2', '4', '4', '', '2', '', NULL, NULL, 'Air conditioning', NULL, NULL, NULL, 'Car Parking', 'Dishwasher', 'Generator', NULL, NULL, 'Gym', NULL, NULL, 'Water Heater', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01193</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (45) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>3ထပ်ခွဲ RC တိုက်အိမ် (အသစ်) အရောင်း</p><p>ဈေးနှုန်း သိန်း(2850) ညှိုနှိုင်း </p><p><br></p><p>မင်းရဲကျော်စွာလမ်းမကြိးအနီး </p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>3ထပ်ခွဲ RCတိုက်အိမ် (အသစ်) အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး နီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01193</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (45) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>3ထပ်ခွဲ RC တိုက်အိမ် (အသစ်) အရောင်း</p><p>ဈေးနှုန်း သိန်း(2850) ညှိုနှိုင်း </p><p><br></p><p>မင်းရဲကျော်စွာလမ်းမကြိးအနီး </p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>3ထပ်ခွဲ RCတိုက်အိမ် (အသစ်) အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး နီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000171', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 07:59 am', 10, 0, '', 'No', NULL),
