(202, 'မြောက်ဒဂုံမြို့နယ် ၃၂ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်ပျဥ္ထောင်အိမ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၂ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်ပျဥ္ထောင်အိမ် အရောင်', 1, 16, 3, '1', '40x60', 'Sqft', 1400, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '1', '1', '', '1', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01202</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (32)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ပျဥ်​ထောင်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1400)ညှိနိူင်း</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး (ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဆရာစံ လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>တစ်ထပ်ပျဥ်ထောင် အိမ်အရောင်းလေးဆိုတော့ စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးကို ဆောက်ပြီးနေမယ့် လူကြီးမင်းတို့အတွက် အဆင်ပြေပါမယ့်နေရာလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးနှစ်ခုအနီးမှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '<p>#AH01202</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (32)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ပျဥ်​ထောင်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1400)ညှိနိူင်း</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး (ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဆရာစံ လမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>တစ်ထပ်ပျဥ်ထောင် အိမ်အရောင်းလေးဆိုတော့ စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးကို ဆောက်ပြီးနေမယ့် လူကြီးမင်းတို့အတွက် အဆင်ပြေပါမယ့်နေရာလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးနှစ်ခုအနီးမှာရှိတဲ့အတွက် ကား