် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000187', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 08:45 am', 4, 0, '', 'No', NULL),
(207, '​မြောက်ဒဂုံမြို့နယ် ၄၅ရပ်ကွက် ပေ၂၀ပေ၆၀ တစ်ထပ်အိမ် အရောင်း', '​မြောက်ဒဂုံမြို့နယ် ၄၅ရပ်ကွက် ပေ၂၀ပေ၆၀ တစ်ထပ်အိမ် အရောင်း', 1, 16, 3, '1', '20x60', 'Sqft', 700, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01197</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (45) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ်  အရောင်း</p><p>ဈေးနှုန်း သိန်း(700) ညှိုနှိုင်း </p><p><br></p><p>မင်းရဲကျော်စွာလမ်းမကြီးတည့်ပေါက် နှင့် ဗန္ဓုလလမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>တစ်ထပ် တိုက်အိမ်  အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#AH01197</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (45) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ်  အရောင်း</p><p>ဈေးနှုန်း သိန်း(700) ညှိုနှိုင်း </p><p><br></p><p>မင်းရဲကျော်စွာလမ်းမကြီးတည့်ပေါက် နှင့် ဗန္ဓုလလမ်းမကြီးအနီး </p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>တစ်ထပ် တိုက်အိမ်  အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000188', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 08:47 am', 5, 0, '', 'No', NULL),
(208, 'မြောက်ဒဂုံမြို့နယ် ၄၅ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၅ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့် အရောင်း', 1, 16, 4, '', '40x60', 'Sqft', 1250, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01196</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (45) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1250) ညှိုနှိုင်း </p><p><br></p><p>မင်းရဲကျော်စွာလမ်းဒဲ့ပေါက် နှင့် ဗန္ဓုလလမ်းမကြီးအနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးဆောက်ပြီးနေချင်သူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OL01196</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (45) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1250) ညှိုနှိုင်း </p><p><br></p><p>မင်းရဲကျော်စွာလမ်းဒဲ့ပေါက် နှင့် ဗန္ဓုလလမ်းမကြီးအနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးဆောက်ပြီးနေချင်သူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000189', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 08:50 am', 6, 0, '', 'No', NULL),
