(217, 'မြောက်ဒဂုံမြို့နယ် ၃၉Bရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်တိုက်အိမ် အသစ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၉Bရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်တိုက်အိမ် အသစ် အရောင်', 1, 16, 11, '1', '40x60', 'Sqft', 2300, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '3', '1', '1', '4', '', '1', '', NULL, NULL, 'Air conditioning', NULL, NULL, NULL, NULL, 'Dishwasher', 'Generator', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01186</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (39B) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်အိမ် (အသစ်) အရောင်း</p><p>ဈေးနှုန်း သိန်း(2300) ညှိုနှိုင်း </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>တစ်ထပ်တိုက်အိမ် (အသစ်) အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး နှစ်ခုအနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01186</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (39B) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်အိမ် (အသစ်) အရောင်း</p><p>ဈေးနှုန်း သိန်း(2300) ညှိုနှိုင်း </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရမ် အမည်ပေါက် </p><p><br></p><p>တစ်ထပ်တိုက်အိမ် (အသစ်) အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး နှစ်ခုအနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000198', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:21 am', 11, 0, '', 'No', NULL),
(218, 'မြောက်ဒဂုံမြို့နယ် ၄၃ရပ်ကွက် ပေ၄၀ပေ၆၀ 2RC အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၃ရပ်ကွက် ပေ၄၀ပေ၆၀ 2RC အရောင်', 1, 16, 3, '2', '40x60', 'Sqft', 2700, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01185</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (43) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>2RC တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(2700) ညှိုနှိုင်း </p><p><br></p><p>ဘုရင့်နောင် လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>2RC တိုက်အိမ် အရောင်းလေးဆိုတော့  အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01185</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (43) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>2RC တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(2700) ညှိုနှိုင်း </p><p><br></p><p>ဘုရင့်နောင် လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>2RC တိုက်အိမ် အရောင်းလေးဆိုတော့  အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လို