(220, 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၂၀ပေ၆၀ မြေသီးသန့် အ ရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၂၀ပေ၆၀ မြေသီးသန့် အ ရောင်း', 1, 16, 4, '', '20x60', 'Sqft', 580, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01184</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(580) ညှိုနှိုင်း </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးဆောက်ပြီးနေချင်သူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OL01184</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(580) ညှိုနှိုင်း </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးဆောက်ပြီးနေချင်သူ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိ