(222, 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ၄၇ပေ၆၀ပေ တစ်ထပ်ခွဲတိုက် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ၄၇ပေ၆၀ပေ တစ်ထပ်ခွဲတိုက် အရောင်', 1, 16, 3, '2', '47x60', 'Sqft', 2000, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01182</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 47 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ခွဲတိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(2000) ညှိုနှိုင်း </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်ခွဲ တိုက်အိမ် အရောင်းလေးဆိုတော့  အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01182</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 47 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်ခွဲတိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(2000) ညှိုနှိုင်း </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်ခွဲ တိုက်အိမ် အရောင်းလေးဆိုတော့  အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000203', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:33 am', 10, 0, '', 'Yes', NULL),
(223, 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၂၀ပေ၆၀ နှစ်ထပ်တိုက် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၂၀ပေ၆၀ နှစ်ထပ်တိုက် အရောင်း', 1, 16, 3, '2', '20x60', 'Sqft', 1300, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01181</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1300) ညှိုနှိုင်း </p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) ဒဲ့ပေါက်</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး ဒဲ့ပေါက်ဖြစ်တဲ့အတွက် ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01181</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1300) ညှိုနှိုင်း </p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) ဒဲ့ပေါက်</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး ဒဲ့ပေါက်ဖြစ်တဲ့အတွက် ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000204', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:35 am', 10, 0, '', 'No', NULL),
(224, 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့် အိမ်အဟောင်းပါ အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့် အိမ်အဟောင်းပါ အရောင်း', 1, 16, 4, '', '40x60', 'Sqft', 1500, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01180</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1500) ညှိုနှိုင်း </p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်းလေး ဆိုတော့  ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ့်လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OL01180</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1500) ညှိုနှိုင်း </p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် (အိမ်အဟောင်းပါ) အရောင်းလေး ဆိုတော့  ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ့်လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000205', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:37 am', 9, 0, '', 'No', NULL),
(225, '​မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်ခံအိမ် အရောင်းး', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်ခံအိမ် အရောင်းး', 1, 16, 3, '2', '40x60', 'Sqft', 950, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01179</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(950) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး</p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01179</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(950) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး</p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000206', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:39 am', 10, 0, '', 'No', NULL),
(226, 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ် အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 1200, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01178</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1200) ညှိုနှိုင်း </p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်အိမ် အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင် </p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01178</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1200) ညှိုနှိုင်း </p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်အိမ် အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင် </p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000207', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:41 am', 8, 0, '', 'No', NULL),
(227, 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ်ခြံခတ်ပီးသား အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ်ခြံခတ်ပီးသား အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 1350, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01177</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် (ခြံခတ်ပြီးသား) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်အိမ် အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OL01177</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် (ခြံခတ်ပြီးသား) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်အိမ် အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000208', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:43 am', 7, 0, '', 'No', NULL),
(228, 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ် ၂လုံးပါ အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ် ၂လုံးပါ အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 1400, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01176</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် (2လုံးပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1400) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး( မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်အိမ်လေး (2လုံးပါ) အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01176</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် (2လုံးပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1400) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး( မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်အိမ်လေး (2လုံးပါ) အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000209', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:45 am', 5, 0, '', 'No', NULL),
(229, 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်ခံအိမ် အရောင်းး', 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်ခံအိမ် အရောင်းး', 1, 16, 3, '2', '40x60', 'Sqft', 1100, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01175</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1100) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး (ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်ခံအိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#AH01175</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1100) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး (ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်ခံအိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000210', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:47 am', 8, 0, '', 'No', NULL),
(230, 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တိုက်ခံအိမ် ၂လုံး အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တိုက်ခံအိမ် ၂လုံး အရောင်', 1, 16, 3, '1', '40x60', 'Sqft', 1100, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01174</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တိုက်ခံအိမ် (2လုံးပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1100) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်တိုက်ခံအိမ်လေး (2လုံးပါ) အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01174</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တိုက်ခံအိမ် (2လုံးပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(1100) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး ( ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်တိုက်ခံအိမ်လေး (2လုံးပါ) အရောင်းလေး ဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေသလို ပြန်ဖျက်ပြီး ပြင်ဆောက်မယ်ဆိုလဲ အဆင်ပြေမယ့် နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000211', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:49 am', 6, 0, '', 'No', NULL),
(231, 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်အိမ်အသစ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်အိမ်အသစ် အရောင်း', 1, 16, 11, '2', '40x60', 'Sqft', 3500, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01173</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ်( အသစ်) အရောင်း</p><p>ဈေးနှုန်း သိန်း(3500) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး (ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01173</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ်( အသစ်) အရောင်း</p><p>ဈေးနှုန်း သိန်း(3500) ညှိုနှိုင်း </p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဘုရင့်နောင်လမ်းမကြီး (ကျောင်းလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000212', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 09:51 am', 8, 0, '', 'No', NULL),
