(233, 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်အိမ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၄ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက်အိမ် အရောင်', 1, 16, 3, '2', '40x60', 'Sqft', 1350, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01170</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)</p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေး လမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#AH01170</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (44) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)</p><p><br></p><p>ဗိုလ်မှူးဗထူး  လမ်းမကြီးအနီး</p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေး လမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေးဆိုတော့ အသင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာဆိုတော့ ကားအဝင်အထွက်လဲ ပြောစရာမလို