(235, 'မြောက်ဒဂုံမြိုနယ် ၃၂ရပ်ကွက် ပေ၂၀ပေ၆၀ တစ်ထပ်တိုက်အိမ် အရောင်း', 'မြောက်ဒဂုံမြိုနယ် ၃၂ရပ်ကွက် ပေ၂၀ပေ၆၀ တစ်ထပ်တိုက်အိမ် အရောင်', 1, 16, 3, '1', '20x60', 'Sqft', 580, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01168</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (32) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(580)</p><p><br></p><p>ပင်လုံလမ်းမအနီး </p><p><br></p><p>လက်ဝဲသုနန္ဒရ လမ်းမ ဒဲ့ပေါက်</p><p><br></p><p>ဂရံ(မိတ်တူ)</p><p><br></p><p>တစ်ထပ်တိုက်အိမ်လေးဆိုတော့ အဆင်သင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကျယ်ဒဲ့ပေါက်ဆိုတော့ ကားအဝင်အထွက်လဲ အဆင်ပြေပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01168</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (32) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(580)</p><p><br></p><p>ပင်လုံလမ်းမအနီး </p><p><br></p><p>လက်ဝဲသုနန္ဒရ လမ်းမ ဒဲ့ပေါက်</p><p><br></p><p>ဂရံ(မိတ်တူ)</p><p><br></p><p>တစ်ထပ်တိုက်အိမ်လေးဆိုတော့ အဆင်သင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကျယ်ဒဲ့ပေါက်ဆိုတော့ ကားအဝင်အထွက်လဲ အဆင်ပြေပါတယ်ရှင်