(236, 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ၄၁ပေ၆၀ပေ နှစ်ထပ်တိုက်အိမ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ၄၁ပေ၆၀ပေ နှစ်ထပ်တိုက်အိမ် အရောင်း', 1, 16, 3, '2', '41x60', 'Sqft', 1350, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01167</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 41 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး</p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေး​ဆိုတော့ အဆင်သင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာ ဆိုတော့ အဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် အဆင်ပြေပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01167</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 41 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး</p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးအနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေး​ဆိုတော့ အဆင်သင့်နေလိုသူ  လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးနှစ်ခု အနီးမှာ ဆိုတော့ အဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် အဆင်ပြေပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000217', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:04 am', 9, 0, '', 'No', NULL),
(237, '​မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့်ခြံခတ်ပီး အရောင်း', '​မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၄၀ပေ၆၀ မြေသီးသန့်ခြံခတ်ပီး အရောင်း', 1, 16, 4, '', '40x60', 'Sqft', 1800, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01166</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60  အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် (ခြံခတ်ပြီး)အရောင်း</p><p>ဈေးနှုန်း သိန်း(1800)ညှိနိူင်း</p><p><br></p><p>ရာဇာဓိရာဇ်လမ်းမကြီးတည့်ပေါက် </p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့်ဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးဆောက်ချင်တယ်ဆိုရင် အဆင်ပြေမယ့်နေရာလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးပေါ်မှာဆိုတော့  ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင်အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OL01166</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60  အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် (ခြံခတ်ပြီး)အရောင်း</p><p>ဈေးနှုန်း သိန်း(1800)ညှိနိူင်း</p><p><br></p><p>ရာဇာဓိရာဇ်လမ်းမကြီးတည့်ပေါက် </p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့်ဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးဆောက်ချင်တယ်ဆိုရင် အဆင်ပြေမယ့်နေရာလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးပေါ်မှာဆိုတော့  ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင်အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000218', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:06 am', 10, 0, '', 'No', NULL),
(238, 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၂၀ပေ၆၀ နှစ်ထပ်တိုက်အိမ် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၂၀ပေ၆၀ နှစ်ထပ်တိုက်အိမ် အရောင်း', 1, 16, 3, '2', '20x60', 'Sqft', 1700, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '2', '1', '3', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01165</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1700)</p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးဒဲ့ပေါက်</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေးဆိုတော့ မိသားစုများတဲ့ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး ဒဲ့ပေါက်ဆိုတော့ ကားအဝင်အထွက်က ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01165</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1700)</p><p><br></p><p>ရာဇာဓိရာဇ် လမ်းမကြီးဒဲ့ပေါက်</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ်လေးဆိုတော့ မိသားစုများတဲ့ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီး ဒဲ့ပေါက်ဆိုတော့ ကားအဝင်အထွက်က ပြောစရာမလိုအောင် သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမ