(247, 'မြောက်ဒဂုံမြို့နယ် ၂၉ရပ်ကွက်ရှိ ၄၉ပေ ၆၂ပေ မြေသီးသန့် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၂၉ရပ်ကွက်ရှိ ၄၉ပေ ၆၂ပေ မြေသီးသန့် အရောင်း', 1, 16, 4, '', '49x62', 'Sqft', 1350, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AL01155</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (29) ရပ်ကွက်</p><p>ပေ 49 ပေ 62 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)ညှိနိူင်း</p><p><br></p><p>ပင်လုံ လမ်းမကြီးအနီး </p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးအတိုင်းကို စိတ်ကြိုက်ဆောက်လို့ရမယ့် မြေကွက်လေးပါရှင်</p><p><br></p><p>လမ်းမကြီးနှစ်ခုအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#AL01155</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (29) ရပ်ကွက်</p><p>ပေ 49 ပေ 62 အကျယ်အဝန်းရှိသော</p><p>မြေသီးသန့် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)ညှိနိူင်း</p><p><br></p><p>ပင်လုံ လမ်းမကြီးအနီး </p><p><br></p><p>ဗန္ဓုလ လမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>မြေသီးသန့် အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့ အိမ်ပုံစံလေးအတိုင်းကို စိတ်ကြိုက်ဆောက်လို့ရမယ့် မြေကွက်လေးပါရှင်</p><p><br></p><p>လမ်းမကြီးနှစ်ခုအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000228', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:31 am', 12, 0, '', 'No', NULL),
(248, 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ကွက်တွဲ ၂ထပ်တိုက် အဆောင်၁၅ခန်းပါ အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ကွက်တွဲ ၂ထပ်တိုက်အဆောင်၁၅ခန်းပါ အရောင်း ', 1, 16, 3, '2', '40x60', 'Sqft', 5000, 'MMK(Lakhs)', 'No', 'Fully Furnished', '15', '1', '1', '2', '3', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01154</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 (နှစ်ကွက်တွဲ)အကျယ်အဝန်းရှိသော </p><p>နှစ်ထပ်တိုက် (အဆောင် 15 ခန်းပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(5000)ညှိနိူင်း</p><p><br></p><p>ပင်လုံ လမ်းမကြီးအနီး </p><p><br></p><p>ဗန္ဓုလလမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေသလို</p><p><br></p><p>အဆောင် 15 ခန်းတောင်ပါတာဆိုတော့ အဆောင်ငှားထားမယ်ဆိုရင်လဲ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01154</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 (နှစ်ကွက်တွဲ)အကျယ်အဝန်းရှိသော </p><p>နှစ်ထပ်တိုက် (အဆောင် 15 ခန်းပါ) အရောင်း</p><p>ဈေးနှုန်း သိန်း(5000)ညှိနိူင်း</p><p><br></p><p>ပင်လုံ လမ်းမကြီးအနီး </p><p><br></p><p>ဗန္ဓုလလမ်းမကြီး (မန္တလေးလမ်း) အနီး</p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေသလို</p><p><br></p><p>အဆောင် 15 ခန်းတောင်ပါတာဆိုတော့ အဆောင်ငှားထားမယ်ဆိုရင်လဲ လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000229', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:35 am', 6, 0, '', 'No', NULL),
(249, '​မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ပေ၂၀ပေ၆၀ ၂ထပ်တိုက်ခံအိမ် အရောင်း', '​မြောက်ဒဂုံမြို့နယ် ၃၇ရပ်ကွက် ပေ၂၀ပေ၆၀ ၂ထပ်တိုက်ခံအိမ် အရောင်း', 1, 16, 3, '2', '20x60', 'Sqft', 750, 'MMK(Lakhs)', 'No', 'Fully Furnished', '2', '1', '1', '', '3', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01153</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(750)ညှိနိူင်း</p><p><br></p><p>ဗန္ဓုလလမ်း (မန္တလေးလမ်း)မကြီးအနီး </p><p><br></p><p>တပင်ရွှေထီးလမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်ကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01153</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (37) ရပ်ကွက်</p><p>ပေ 20 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(750)ညှိနိူင်း</p><p><br></p><p>ဗန္ဓုလလမ်း (မန္တလေးလမ်း)မကြီးအနီး </p><p><br></p><p>တပင်ရွှေထီးလမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်ခံအိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်ကောင်းလေးပါရှင်</p><p>