(251, 'မြောက်ဒဂုံမြို့နယ် ၃၈ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ်အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၃၈ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်အိမ်အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 1350, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#AH01151</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (38) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စုလမ်းမကြီးအနီး</p><p><br></p><p>တပင်ရွှေထီးလမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်အိမ်အဟောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့</p><p>အိမ်ပုံစံလေး ဆောက်ပြီးနေမယ်ဆိုအဆင်ပြေမယ့် နေရာလေးပါရှင်</p><p><br></p><p>အိမ်အဟောင်းလေးဆိုတော့ ပြန်ဖျက်ဆောက်ရမှာ လွယ်ကူအဆင်ပြေပါယတ်ရှင်</p><p><br></p><p>ကွန်ကရစ်လမ်းမကြီး ဖြစ်တဲ့အတွက် လူကြီးမင်းတို့ကား ထိခိုက်မိမှာကိုလဲ</p><p>မစိုးရိမ်ရတဲ့အတွက် အဆင်ပြေတဲ့နေရာကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးနှစ်ခုအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့. ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#AH01151</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (38) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်အိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1350)ညှိနိူင်း</p><p><br></p><p>ပြည်ထောင်စုလမ်းမကြီးအနီး</p><p><br></p><p>တပင်ရွှေထီးလမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်အိမ်အဟောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကူးထားတဲ့</p><p>အိမ်ပုံစံလေး ဆောက်ပြီးနေမယ်ဆိုအဆင်ပြေမယ့် နေရာလေးပါရှင်</p><p><br></p><p>အိမ်အဟောင်းလေးဆိုတော့ ပြန်ဖျက်ဆောက်ရမှာ လွယ်ကူအဆင်ပြေပါယတ်ရှင်</p><p><br></p><p>ကွန်ကရစ်လမ်းမကြီး ဖြစ်တဲ့အတွက် လူကြီးမင်းတို့ကား ထိခိုက်မိမှာကိုလဲ</p><p>မစိုးရိမ်ရတဲ့အတွက် အဆင်ပြေတဲ့နေရာကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးနှစ်ခုအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့. ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000232', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:42 am', 8, 0, '', 'No', NULL),
(252, 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၄၀ပေ၆၀ ၂ထပ်တိုက် အရောင်', 1, 16, 3, '2', '40x60', 'Sqft', 1300, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01149</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1300)ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်ကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01149</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>နှစ်ထပ်တိုက် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1300)ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>နှစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်ကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000233', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:44 am', 7, 0, '', 'No', NULL),
(253, '​မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်တိုက် အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၁ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်တိုက် အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 1500, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01148</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1500)ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်ကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '<p>#OH01148</p><p>ရန်ကုန်မြို့မြောက်ဒဂုံမြို့နယ် (41) ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော</p><p>တစ်ထပ်တိုက် အရောင်း</p><p>ဈေးနှုန်း သိန်း(1500)ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင် လမ်းမကြီးအနီး </p><p><br></p><p>တပင်ရွှေထီး လမ်းမကြီးအနီး </p><p><br></p><p>ဂရံ</p><p><br></p><p>တစ်ထပ်တိုက်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေမယ့် အိမ်ကောင်းလေးပါရှင်</p><p><br></p><p>လမ်းမကြီးအနီးဆိုတော့ ကားအဝင်အထွက်သာပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1 : 1 ရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်း​ဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000234', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 10:48 am', 7, 0, '', 'No', NULL),
