(258, 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ ပေ၆၀ ပျဥ္ထောင်အိမ်အရောင်း', 'မြောက်ဒဂုံမြို့နယ် ၄၀ရပ်ကွက် ပေ၄၀ ပေ၆၀ ပျဥ္ထောင်အိမ်အရောင်း', 1, 16, 3, '1', '40x60', 'Sqft', 1000, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '1', '1', '1', '1', '', '1', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01143</p><p>ရန်ကုန်မြို့ ​​​​​​​​​​​​​​​​​​​မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်ရှိ</p><p>ပေ၄၀×ပေ၆၀ အကျယ်အဝန်းရှိသော</p><p>​​​​​​​​​ပျဥ်ထောင်အိမ် အရောင်း</p><p>ဈေးနှုန်းက(1000)သိန်း ညှိနှိုင်း</p><p><br></p><p>ပါမစ်</p><p><br></p><p>ရာဇဓိရာဇ်လမ်းမကြီးအနီး</p><p><br></p><p>ပျဥ်ထောင်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေသလို အိမ်ကိုဖျက်ပြီး လူကြီးမင်းတို့ စိတ်တိုင်းကျ အိမ်ပုံစံလေးကို ဆောက်နေမယ်ဆိုရင် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>ကွန်ကရစ်လမ်းမကြီး ခင်းထားတဲ့အတွက် လူကြီးမင်းတို့ရဲ့ ကားထိခိုက်မှာလဲ စိုးရိမ်စရာမလိုတဲ့အတွက် အဆင်ပြေပါတယ်ရှင် </p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးတွေမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်<br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/<br></p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်<br></p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p>phဆက်​စုံစမ်းနိုင်​ပါတယ်​ရှင်</p><p>', '<p>#OH01143</p><p>ရန်ကုန်မြို့ ​​​​​​​​​​​​​​​​​​​မြောက်ဒဂုံမြို့နယ် (40) ရပ်ကွက်ရှိ</p><p>ပေ၄၀×ပေ၆၀ အကျယ်အဝန်းရှိသော</p><p>​​​​​​​​​ပျဥ်ထောင်အိမ် အရောင်း</p><p>ဈေးနှုန်းက(1000)သိန်း ညှိနှိုင်း</p><p><br></p><p>ပါမစ်</p><p><br></p><p>ရာဇဓိရာဇ်လမ်းမကြီးအနီး</p><p><br></p><p>ပျဥ်ထောင်အိမ် အရောင်းလေးဆိုတော့ အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေသလို အိမ်ကိုဖျက်ပြီး လူကြီးမင်းတို့ စိတ်တိုင်းကျ အိမ်ပုံစံလေးကို ဆောက်နေမယ်ဆိုရင် အဆင်ပြေမယ့် အိမ်လေးပါရှင် </p><p><br></p><p>ကွန်ကရစ်လမ်းမကြီး ခင်းထားတဲ့အတွက် လူကြီးမင်းတို့ရဲ့ ကားထိခိုက်မှာလဲ စိုးရိမ်စရာမလိုတဲ့အတွက် အဆင်ပြေပါတယ်ရှင် </p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးတွေမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်<br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/<br></p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်<br></p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p>phဆက်​စုံစမ်းနိုင်​ပါတယ်​ရှင်</p><p>', '', '', '1', 'for_sale', 'S-000238', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 17:29 pm', 6, 0, '', 'No', NULL),
