်းလမ်း) ဒဲ့ပေါက်</p><p><br></p><p>ပျဥ်ထောင်အိမ် အရောင်းလေးဆိုတော့အဆင်သင့်နေလိုသူ လူကြီးမင်းများအတွက် အဆင်ပြေသလို အိမ်ဖျက်ပြီး ပြန်ဆောက်မယ့် လူကြီးမင်းတို့ အဆင်ပြေတဲ့ နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီး ဒဲ့ပေါက်ဖြစ်တဲ့အတွက် ကားအဝင်အထွက်လဲ ပြောစရာမလိုအောင် အဆင်ပြေပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးတွေမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p>phဆက်​စုံစမ်းနိုင်​ပါတယ်​ရှင်​</p><p><br></p><p>Tat Nay Won Realestate Co;ltd</p><p> Ph::09.448025742</p><p>            09.268858885</p><p>            09.420107021</p><p>office ph.09.425306167</p><p>                     09.256841877</p>', '', '', '1', 'for_sale', 'S-000242', NULL, NULL, NULL, 0, '2021-07-27', '27 July, 2021 17:40 pm', 12, 0, '', 'No', NULL),
