(278, 'မြောက်ဒဂုံမြို့နယ် ၃၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်RCအိမ် ရောင်းရန်ရှိသည် ', 'မြောက်ဒဂုံမြို့နယ် ၃၄ရပ်ကွက် ပေ၄၀ပေ၆၀ တစ်ထပ်RCအိမ် ရောင်းရန်ရှိသည် ', 1, 16, 3, '1', '40x60', 'Sqft', 4400, 'MMK(Lakhs)', 'No', 'Fully Furnished', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OH01381</p><p>ရန်ကုန်မြို့​မြောက်ဒဂုံမြို့နယ် (34)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော </p><p>တစ်ထပ်RCအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (4400) ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင်လမ်းမကြီးပေါ်</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်RCတိုက်အိမ် အရောင်းလေးဆိုတော့  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးပေါ်မှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '<p>#OH01381</p><p>ရန်ကုန်မြို့​မြောက်ဒဂုံမြို့နယ် (34)ရပ်ကွက်</p><p>ပေ 40 ပေ 60 အကျယ်အဝန်းရှိသော </p><p>တစ်ထပ်RCအိမ် အရောင်း</p><p>ဈေးနှုန်း သိန်း (4400) ညှိနိူင်း</p><p><br></p><p>ဗိုလ်မင်းရောင်လမ်းမကြီးပေါ်</p><p><br></p><p>ဂရမ်</p><p><br></p><p>တစ်ထပ်RCတိုက်အိမ် အရောင်းလေးဆိုတော့  လူကြီးမင်းတို့အတွက် အဆင်ပြေမယ့်နေရာလေးပါရှင် </p><p><br></p><p>လမ်းမကြီးပေါ်မှာရှိတဲ့အတွက် ကားအဝင်အထွက်ကတော့ ပြောစရာမလိုအောင် သာပါတယ်ရှင် </p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>Dataထဲတွင်မပါသောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>ဖုန်းဖြင့်ဆက်သွယ်စုံစမ်းပါကလည် မေးသမျှကို သေချာစွာဖြေကြားပြီး သိလိုသမျှကို ဖော်ရွေစွာဖြင့် ရှင်းပြပေးနေပါပြီ</p><p><br></p><p>️', '', '', '1', 'for_sale', 'S-000258', NULL, NULL, NULL, 0, '2021-08-07', '7 August, 2021 14:39 pm', 36, 0, '', 'No', NULL),
(279, 'မြောက်ဒဂုံမြို့နယ် ၃၄ရပ်ကွက် ၄၃ပေ ၆၀ပေ မြေသီးသန့်(အဆောင်ဆောက်ထား) ရောင်းရန်ရှိသည်', 'မြောက်ဒဂုံမြို့နယ် ၃၄ရပ်ကွက် ၄၃ပေ ၆၀ပေ မြေသီးသန့်(အဆောင်ဆောက်ထား) ရောင်းရန်ရှိသည်', 1, 16, 4, '', '43x60', 'Sqft', 2650, 'MMK(Lakhs)', 'No', 'Other', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>#OL01110</p><p>ရန်ကုန်မြို့ မြောက်ဒဂုံမြို့နယ် (34)ရပ်ကွက်ပေ၄၃ပေ၆၀ အကျယ်အဝန်းရှိသော ​</p><p>မြေသီးသန့် အရောင်း (အဆောင်ဆောက်ထား)</p><p>ဈေးနှုန်း  သိန်း(2650)ညှိနိူင်း</p><p><br></p><p>ပင်လုံလမ်းမကျောကပ်</p><p><br></p><p>ဂရံ(အမည်ပေါက်)</p><p><br></p><p>မြေသီးသန့်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကြိုက်ဆောက်ပြီးနေဖို့အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1:1 လည်းရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '<p>#OL01110</p><p>ရန်ကုန်မြို့ မြောက်ဒဂုံမြို့နယ် (34)ရပ်ကွက်ပေ၄၃ပေ၆၀ အကျယ်အဝန်းရှိသော ​</p><p>မြေသီးသန့် အရောင်း (အဆောင်ဆောက်ထား)</p><p>ဈေးနှုန်း  သိန်း(2650)ညှိနိူင်း</p><p><br></p><p>ပင်လုံလမ်းမကျောကပ်</p><p><br></p><p>ဂရံ(အမည်ပေါက်)</p><p><br></p><p>မြေသီးသန့်အရောင်းလေးဆိုတော့ လူကြီးမင်းတို့စိတ်ကြိုက်ဆောက်ပြီးနေဖို့အဆင်ပြေပါတယ်ရှင်</p><p><br></p><p>ပတ်ဝန်းကျင်သန့်နေရာကောင်းလေးမို့လက်မလွှတ်ရအောင်အမြန်ဆုံးဆက်သွယ်လိုက်ပါရှင်</p><p><br></p><p>အကျိုးတူ 1:1 လည်းရပါတယ်ရှင်</p><p><br></p><p>Dataထဲတွင်​မပါ​သောဒဂုံလေးမြို့နယ်/</p><p>မြို့နယ်စုံ/မြေ/condo/လုံးခြင်းအငှါး/​​</p><p>အရောင်းများ</p><p>‌</p><p>လုံးခြင်းအရောင်းများစွာနှင့်</p><p>တခြားမြို့နယ်များမှမြေအရောင်း/အ၀ယ်/အငှါးများစွာရှိပါသည်</p><p>လူကြီးမင်းတို့သုံးမယ့်ငွေပေါ်မူတည်ပီးပြပေးနိုင်ပါသည်</p><p><br></p><p>တက်နေဝန်း အိမ်ခြံမြေအကျိုးဆောင်ကုမ္ပဏီလီမိတက်</p><p>လိပ်စာ -အမှတ် (၁၉၆) ၊ ပင်လုံလမ်းမကြီးပေါ် ၊ (၃၅)ရပ်ကွက် ၊ကျောင်းလမ်းမှတ်တိုင်ရှေ့ ။</p><p><br></p><p>', '', '', '1', 'for_sale', 'S-000259', NULL, NULL, NULL, 0, '2021-08-07', '7 August, 2021 14:44 pm', 22, 0, '', 'Yes', NULL),
