INSERT INTO `property_book` (`pb_id`, `title`, `description`, `photo`, `admin_id`, `status`, `carete_date`, `upload_date`) VALUES
(1, 'How to Flip a House as a Real Estate Investor', '<p><span xss=removed>\"Real Estate Investing: How to Flip a House as a Real Estate Investor\" teaches those interested in investing in real estate how to get started wholesaling houses for quick cash profits. Topics covered include Investor Objectives, Building Your Team, Finding Wholesale Buyers, Finding Motivated Sellers, Finding Wholesale Properties, Deal Analysis, Negotiating With Sellers and Buyers, Making Offers, Contract Clauses, Marketing Your Deals, and Closings and Getting Paid. If you want to flip a house or see yourself flipping properties for a living, this ebook will teach you the basics of how to wholesale a house, also known as flipping houses. For the price it\'s a no-brainer, get it today and get started.</span><br></p>', 'cfa22438a606d2eb312310cf9eacdf59.jpg', 1, '0', '2021-07-09', 'July 9, 2021');
INSERT INTO `property_guide` (`pg_id`, `title`, `description`, `photo`, `admin_id`, `status`, `carete_date`, `upload_date`) VALUES
(1, 'နှစ်ဦးအမည်နှင့် ဝယ်ထားသည့် အိမ်ခြံမြေ တိုက်ခန်းကို ဝယ်မည်ဆိုလျှင်', '<p>နှစ်ဦးအမည်နှင့် ဝယ်ထားသည့် အိမ်ခြံမြေ တိုက်ခန်းကို ဝယ်မည်ဆိုလျှင်<br></p>', 'e8cccfad732b323777f9e55ac1811d35.png', 1, 1, '2021-07-09', 'July 9, 2021'),
(2, 'စာချုပ်ချုပ်မည်ဆိုလျှင် မှတ်ပုံတင်ကို မစီစစ်ခဲ့သည့် ကိစ္စ', '<p><font color=\"#ffd663\" xss=removed>စာချုပ်ချုပ်မည်ဆိုလျှင် မှတ်ပုံတင်ကို </font></p><p xss=removed><font color=\"#ffd663\" xss=removed>မစီစစ်ခဲ့သည့် ကိစ္စ</font></p><p><b> ။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။။</b></p><p><b><br></b></p><p xss=removed><b>စာချုပ်ချုပ်ရာတွင် လက်လွတ်စပယ် လုပ်ဆောင်နေကြသော လုပ် ဆောင်ချက်တစ်ခုမှာ စာချုပ်သူတို့၏ အမည် မှတ်ပုံတင်တို့ကို စာချုပ်ချုပ်သူများ ကိုယ်တိုင်က မစိစစ်ဘဲ ချုပ်ဆိုပေးလိုက်ကြသည့် ကိစ္စရပ်ပင် ဖြစ်သည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>စာချုပ်ချုပ်ပေးသူ၊ ရေးပေးသူများသည် စာချုပ်ချုပ်ဆိုသူများ၏ အမည်၊ မှတ်ပုံတင်၊ နေရပ်လိပ်စာတို့ကို မေးမြန်းရာတွင် ထိုသူတို့၏ ပြောဆိုချက်ကိုသာ စာချုပ်တွင် ဖော်ပြ ရေးသားလေ့ရှိပြီး ထိုသူပြောသကဲ့သို့ ထို သူ၏ အမည်၊ မှတ်ပုံတင် ၊ မှန် မမှန်ဆိုသည်ကို မလေ့လာ ၊မစူးစမ်း ၊ မစိစစ်ဘဲ ရှိတတ်ကြပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>သာမန်စာချုပ်မျာတွင် အရေးမကြီးလှဟု ဆိုသော်လည်း မိမိက ရရန် ရှိသော ကိစ္စရပ်များဖြစ်ပါမူ စိစစ်ရန် လိုအပ်ပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဤသို့ဆိုခြင်းဖြင့် စာချုပ်ချုပ်ရာတွင် မိမိအတွက် ရရန်ရှိသော စာချုပ်ချုပ်ရာတွင် တစ်မျိုး၊ မိမိက ပေးရန်ရှိ သော စာချုပ်ချုပ်ရာတွင် တစ်မျိုး၊ သဘောထား အမျိုးမျိုး ထားရှိရမည်ဟူ၍ ဆိုလိုခြင်း မဟုတ်ပါ။ တာဝန်ယူ ချုပ်ဆိုပေးသူများ ၊ တာဝန်ကျေရန် ၊ အမှားအယွင်း ချို့ယွင်းချက် နည်းနိုင်သမျှ နည်းပါးစေရန် သတိပေးရခြင်း ဖြစ်ပြီး သာ၍ပင် စိစစ်ရန် သင့်သည့်အပိုင်းကို ရည်ညွှန်း ဖော်ပြခြင်း ဖြစ်ပါသည်။ မိမိက ရရန်ရှိသည်ပင် ဖြစ်စေ၊ ပေးရန်ရှိသည်ပင်ဖြစ်စေ စာချုပ်ပြုလုပ်မှတော့ ပြုလုပ်ရကျိုးနပ်အောင် စာချုပ်ချုပ်မှု အပိုင်းနှင့်ဆိုင်သည်များကို ပီပီပြင်ပြင် တိတိကျကျ လုပ်ဆောင်ကြရန် လိုပါမည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>အချိန်ကိုလုပြီး ချုပ်ရတာဖြစ်လို့ ။ အားနားလို့ ၊ မလိုဘူးထင်လို့ --- - ဆိုသည့် ဆင်ခြေများနှင့်အတူ နောင် တစ်ဖန် မဖြစ်မိရန် အရေးကြီးပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>နမူနာအနေဖြင့် အဖြစ်အပျက်တစ်ခုကို တင်ပြပါမည်။ မြေကွက်တစ်ကွက်ကို ရောင်းမည်ဖြစ်၍ ဝယ်မည့်သူ က ပိုင်ဆိုင်ခွင့်စာချုပ် အထောက် အထားများကို တောင်းကြည့်ပါသည်။ ရောင်းသူက ပိုင်ဆိုင်ခွင့်စာချုပ် စာတမ်း များ အားလုံးကို ပြသပါသည်။ စာချုပ်စာတမ်း အထောက် အထားများအရ ပိုင်သူ၏ အမည်သည် ဦးနီ ဖြစ်ပါ သည်။ ရောင်းသူကလည်း ၎င်းကိုယ်၎င်း ဦးနီဟု ဆိုပါသည်။ ၎င်းနှင့်အတူ ရှိသူများကလည်း ၎င်းအားဦးနီ၊ ဦးနီ ဟူ၍ ခေါ်ဝေါ် သုံးနှုန်းကြပါသည်။ ထို့ကြောင့် စာချုပ် စာတမ်း ပိုင်ခွင့်များကို ပြသနေသူမှာ ၊ ဦးနီဟုပင် ယူဆ စရာ ဖြစ်ပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ပြသသော စာချုပ်စာတမ်းများ အထောက်အထားများ အခိုင်အမာ အစစ် အမှန် ဖြစ်သည်ကို စိတ်ချယုံကြည် သဖြင့် ဝယ်သူက ဝယ်ရန်သဘောတူပါသည်။ ရောင်းဝယ်သော မြေ၏ ရောင်းဈေးမှာ ငွေကျပ် သိန်း ၄၀၀၀ ဖြစ်ပြီး စရန်ပေး စာချုပ် ပြုလုပ်ချိန်တွင် စရန်ငွေတစ်ဝက်ဖြစ်သော ငွေကျပ် သိန်း၂၀၀၀ ကို စာချုပ်ပြုလုပ်၍ ပေးအပ်ပါသည်။ ရောင်းသူ ဦးနီက စရန်ငွေရရှိကြောင်း စာချုပ်တွင် လက်မှတ်ရေးထိုး ပေးပြီး ငွေကျပ် သိန်း၂၀၀၀ကို ရယူ လိုက်ပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>စရန်းပေး စာချုပ်ချုပ်ရာတွင် ရောင်းသူနေရာ၌ ဦးနီဟု စာချုပ်ကို ရေး သားသူက ဖော်ပြပါသည်။ ဦးနီ၏ မှတ် ပုံတင်ကို များသောအားဖြင့် ပိုင်ဆိုင်မှု စာချုပ်စာတမ်းတွင် ပါရှိသည့် မှတ်ပုံတင်အတိုင်း ပြန်လည် ရေးကူးဖော် ပြကြ ပါသည်။ အချို့ကလည်း ရောင်းသူအား မှတ်ပုံတင်နံပါတ်ကိုမေး၍ ရောင်းသူ ရွတ်ပြသည့်အတိုင်း စာချုပ် တွင် ရေးတတ်ကြပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>မှတ်ပုံတင် ခဏလောက်ပြပါ ဟူ၍ တောင်းယူကြည့်သူ လွန်စွာ နည်း ပါးသည်ကို တွေ့ရပါသည်။ တချို့ ထိုသို့ တောင်းသောအခါ ရောင်းသူ များက ၎င်း၏ မှတ်ပုံတင် ဘယ်သူယူသွားလို့ ၊ ဘယ်ရောက်နေလို့ ဆို သည်များကို အကြောင်းပြ ပြောဆိုကာ တိုက်ဆိုင်စစ်ဆေးမှုကို ရှောင်လွဲတတ် သည် များလည်း ရှိပါ သည်။ ဤ သို့ဆိုလျှင် အထူး သတိထားစရာ ဖြစ်ပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>အထက်ပါ ကိစ္စရပ်တွင် စာချုပ်စာတမ်း အစစ်အမှန်များ ပြသနိုင်သည့် အတွက် ပိုင်ဆိုင်သူ အစစ်အမှန် ပုဂ္ဂိုလ်ဟု ထင်မြင်ယူဆကာ ဦးနီ အမှတ်နှင့် စာချုပ်ပြုလုပ်၍ စရန်ငွေများ ချပေးလိုက်ခြင်း ဖြစ်ပါသည်။ ပစ္စည်း နှင့် ပတ်သက်သည့် စာချုပ်စာတမ်းများကိုသာ ဟုတ် မဟုတ် ၊ မှန် မမှန် စိစစ်ကြည့်ပြီး ရောင်းသူနှင့် ပတ်သက် သည့် လူပုဂ္ဂိုလ်အစစ် ဟုတ်မဟုတ် ၊ မှန်မမှန်ကို မစိစစ်မိခဲ့သည့်အတွက် ကိုယ်ကျိုးနည်းခဲ့ရသည့် သာဓကများ အဖြစ်အပျက်များ များစွာရှိပါကြောင်း တင်ပြရင်း ချုပ်သူတို့၏ မှတ်ပုံတင်ကို မစိစစ်ဘဲ မချုပ်မိစေရန် လက်တို့ သတိပေးလိုက်ရပါသည်။</b></p><p xss=removed><b><br></b></p><p xss=removed><b>(စာညွှန်း - ဦးကျော်ဇေယျ၊ စာချုပ်ချုပ်ဆိုမည်ဆိုလျှင် ဆောင်ရန်နှင့်ရှောင်ရန်များ ၊ စာ ၅၆ ) #DVBLawLab</b><br></p>', '48a0448535da54bd1c8fd92476321be4.jpg', 1, 1, '2021-07-27', 'July 27, 2021'),
(3, 'မြေကွက်ပုံစံပေါ်မူတည်ပီး ဧကတွက်နည်း', '<p xss=removed><u><b xss=removed>မြေကွက်ပုံစံပေါ် မူတည်ပြီး ဧကတွက်နည်း</b></u></p><ul><li xss=removed><b>မြေဧကကို ဘယ်လိုတွက်ရသလဲ ခဏခဏ  မေးလာလို့ အတတ်နိုင်ဆုံး ရှင်းလင်းအောင် တွက်ချက်နည်းကို ဖော်ပြလိုက်ပါတယ်။ မိမိမြေကွက်၏ ပုံသဏ္ဍန်ကိုကြည့်၍ ဧကတွက်နိုင်ပါသည်။</b></li></ul><p xss=removed><u>လေးနားညီ စတုရန်းပုံစံ ဖြစ်ပါက</u></p><p xss=removed><b>======================</b></p><p xss=removed><b>၂၀၈.၇၁\' × ၂၀၈.၇၁\' ÷ ၄၃၅၅၉.၈၆ = ၁ ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဥပမာ: ၁၀၀ ပေပတ်လည် အကွက်ဖြစ်လျှင်</b><br></p><p xss=removed><b>၁၀၀\' × ၁၀၀\' ÷ ၄၃၅၆၀ = ၀. ၂၂၉ ဧက</b></p><p xss=removed><u><br></u></p><p xss=removed><u>နှစ်နားညီ စတုဂံပုံစံ ဖြစ်ပါက</u><br></p><p xss=removed><b>===================</b></p><p xss=removed><b>(လ x န)\' ÷ ၄၃၅၆၀ = ... ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဥပမာ: </b></p><p xss=removed><b>(၄၀\'×၆၀\') ÷ ၄၃၅၆၀ = ၀.၀၅၅ ဧက</b></p><p xss=removed><b>(၆၀\'×၁၀၀\') ÷ ၄၃၅၆၀ = ၀.၁၃၇ ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><u>နှစ်နားပြိုင် တြာဗီဇီယံပုံစံ ဖြစ်ပါက</u></p><p xss=removed><b>========================</b></p><p xss=removed><b>ပြိုင်နားနှစ်ခုပေါင်း ÷ ၂ x နံ ÷ ၄၃၅၆၀ = ... ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဥပမာ:</b></p><p xss=removed><b>[{(၅၀+၈၀)÷၂}×၆၀]÷၄၃၅၆၀ = ၀.၀၈၉ ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><u>တြိဂံပုံစံဖြစ်ပါက</u></p><p xss=removed><b>===========</b></p><p xss=removed><b>၅ x အခြေ x အမြင့် ÷ ၄၃၅၆၀ = ... ဧက</b></p><p xss=removed><b>½ အခြေ x အမြင့် ÷ ၄၃၅၆၀ = ... ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဥပမာ:</b></p><p xss=removed><b>၅ × ၁၀၀\' × ၅၀\' ÷ ၄၃၅၆၀ = ၀.၀၅၇ ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><u xss=removed>ထောင့်မှန် တြိဂံပုံစံဖြစ်ပါက</u></p><p xss=removed><b>===================</b></p><p xss=removed><b>အခြေ x အမြင့် = ရလာဒ် ÷ ၂ ÷ ၄၃၅၆၀</b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဥပမာ: ၁၀၀\' × ၅၀\' = ၅၀၀၀\'</b></p><p xss=removed><b>၅၀၀၀ ÷ ၂ ÷ ၄၃၅၆၀ = ၀.၀၅၇ ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><u xss=removed>စက်ဝိုင်းပုံစံဖြစ်ပါက</u></p><p xss=removed><b>==============</b></p><p xss=removed><b>အချင်းဝက် x အချင်းဝက် x ပိုင်ကိန်း ÷ ၄၃၅၆၀ = .... ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><b>အချင်း x အချင်း x .၇၈၅၄ ÷ ၄၃၅၆၀ = ... ဧက ( ပုံသေမြှောက်ကိန်း .၇၈၅၄ )</b></p><p xss=removed><b><br></b></p><p xss=removed><b>(.၇၈၅၄ သည် ပိုင်ကိန်း ၃.၁၄၁၆ ကို အနားလေးဖက် ၄ နှင့် စားပြီး စတုရန်းကွက်ဖေါ်ခြင်းဖြစ်သည်။ ) </b></p><p xss=removed><b><br></b></p><p xss=removed><b>ဥပမာ:</b></p><p xss=removed><b>၅၀\' × ၅၀\' × .၇၈၅၄ ÷ ၄၃၅၆၀ = ၀.၀၄၅ ဧက</b></p><p xss=removed><b><br></b></p><p xss=removed><b>အနား ၅ မျက်နှာ ၆ မျက်နှာနှင့် အနားများစွာပါသော ပုံစံဖြစ်လျှင် စတုဂံ စတုရန်း တြိဂံစသည် အကွက်စိပ်ပြီးတွက်၊ ရလာဒ်အားလုံးကို ပေါင်း၍ ၄၃၅၆၀ ဖြင့်စား (၁ ဧက = ၄၃၅၆၀ စတုရန်းပေ) </b></p><p xss=removed><br></p><p xss=removed>#Shared #Shared_Myay #Myay #ရှယ်မြေ #မြေ #စိုက်ပျိုးရေး #စိုက်ပျိုးမြေ #နည်းပညာ</p>', '0cb15b483cd9193f96940c55ef4cf46e.jpg', 1, 1, '2021-07-27', 'July 27, 2021'),
(4, 'လူနေထိုင်ခွင့် ( BCC) ဆိုတာဘာလဲ...', '<p xss=removed><u><b>လူနေထိုင်ခွင့် ( BCC) ဆိုတာဘာလဲ...</b></u></p><p xss=removed><br></p><p xss=removed><span xss=removed>တချို့နေရာတွေမှာ အဆောက်အဦးဆောက်လို့ပြီးနေပေမယ့် ဘာကြောင့် လူနေထိုင်လို့ မရတာလဲ...</span></p><p xss=removed><span xss=removed>BCC ဆိုတာ တိုက်ခန်းရောင်း၊ဝယ် လုပ်ရင် ဘယ်လိုအရေးပါသလဲ....ဆိုတာတွေကို အိမ်ပိုင်ရှင်တွေအနေနဲ့ မဖြစ်မနေ သိထားရအောင် ပြန်လည် မျှဝေပေးလိုက်ပါတယ်....<br></span></p><p xss=removed><span xss=removed><br></span></p><p xss=removed><b><u>တိုက်ခန်း ဝယ်သူတွေ မေးကြတဲ့ ဘီစီစီ(BCC) စာရွက်ဆိုတာ</u></b></p><p xss=removed>************************************************</p><p xss=removed><span xss=removed>BCC စာရွက်ဆိုတာ ( Building Complete Certificate ) (လူနေထိုင်ခွင့်ပုံစံ) စာရွက်လို့ ခေါ်ဆိုပါတယ်။ အဲဒီစာရွက်လေးဟာ တိုက်ခန်းတစ်ခန်း ဝယ်ယူမယ်ဆိုရင် အခြားလိုအပ်တဲ့ စာရွက်စာတန်းတွေနဲ့ အတူ BCC စာရွက်လေး ကိုလဲ အဓိကထား စစ်ဆေးသင့်ပါတယ်။ အဆိုပါ စာရွက်ဟာ လူနေထိုင်ခွင့်ပုံစံ စာရွက်ဖြစ်သလို နောင်တစ်ချိန် အရောင်းအဝယ် ပြန်လုပ်တဲ့ အခါမှာ မရှိမဖြစ် လိုအပ်တဲ့ စာရွက်ဖြစ်ပြီး အဲ့ဒီစာရွက်မရှိပါက ရောင်းဝယ်ဖို့ ကြန့်ကြာနိုင်ပါတယ်။</span></p><p xss=removed><span xss=removed><br></span></p><p xss=removed><span xss=removed>ဘီစီစီစာရွက်ပါလို့ ပေးလိုက်ပေမယ့် ဘီစီစီစာရွက်လို့ မသိကြတဲ့သူတွေ ရှိ နေပါတယ်။</span></p><p xss=removed><span xss=removed> ဘီစီစီကို လူနေထိုင်ခွင့်လို့ လူတွေအလွယ်ပြောပါတယ် ။ </span></p><p xss=removed><span xss=removed>အဲဒီတော့ စာရွက်ပေါ်မှာ လူနေထိုင်ခွင့်လို့ ပါနေလိမ့်မယ်လို့ မသိစိတ်က ထင်မှတ်ထားကြပါတယ် ။</span></p><p xss=removed><span xss=removed>ဒါပေမယ့် ဘီစီစီ(BCC) ဆိုတာ Building Completion Certificate ဆိုတဲ့ စည်ပင်ဌာနကထုတ်ပေးတဲ့ အဆောက်အဦးပြီးစီးကြောင်း အသိအမှတ်ပြုလွှာလို့ ခေါ်တာပါ။</span></p><p xss=removed><span xss=removed>ဘီစီစီကို လူနေခွင့်လို့ အကြမ်းဖျဉ်းသိထားတဲ့သူတွေက ဘီစီစီစာရွက်လည်း မြင်ရော “လူနေခွင့်ပြုသည်” ဆိုတဲ့ စာသားမပါလို့ဆိုပြီး ရောင်းတဲ့သူ နဲ့ အကျိူးဆောင်တွေကို မယုံမကြည် မေးတတ်ပြန်ပါတယ် ။ </span></p><p xss=removed><span xss=removed>ဘီစီစီစာရွက်ဆိုတာ ဘယ်လိုပုံစံမျိူးလဲဆိုတာ ဝယ်သူက သေချာမသိတာပါ..။ </span></p><p xss=removed><span xss=removed>ဒါကြောင့် ဒီလိုပြဿနာတွေ ဖြစ်နေတဲ့ အပေါ်ဘီစီစီ ဆိုတာကို နားလည်နိုင်စေဖို့ ဖြစ်ပါတယ်။<br></span></p><p xss=removed><span xss=removed>ပိုပြီးဆိုးတာက ဘုတ်စိမ်းလို့အလွယ်ခေါ်တဲ့ ဆောက်လုပ်ခွင့်ပြုမိန့်စာရွက်မှာ လူနေထိုင်ရန်ဆိုတဲ့ စာလုံးကို စာလုံးဆိုဒ်အကြီးနဲ့ မင်ခုံနဲ့ထုပြီး ပါတာကို ဘီစီစီ ထင်တာပါပဲ..။ <br></span></p><p xss=removed><span xss=removed>လူနေထိုင်ရန် ဆိုတဲ့ စာလုံးအကြီးပါတဲ့စာရွက်က ဘုတ်စိမ်းစာရွက်(ဆောက်လုပ်ခွင့်ပြုတဲ့အမိန့်)စာရွက်ပါ..။</span></p><p xss=removed><span xss=removed> လူနေရန် ဆိုတဲ့ စာလုံးကြီးကြီးပါနေတာက လုပ်ငန်းလုပ်ရန်( Commercial) နဲ့ ခွဲခြားသတ်မှတ်ထားတာပါ..။</span></p><p xss=removed><span xss=removed>ဘုတ်စိမ်းစာရွက်ပါရင် တရားဝင်ဆောက်လုပ်ခွင့်ပြုမိန့်နဲ့ ဆောက်တဲ့တိုက်လို့ ဆိုလိုတာပါ..။</span></p><p xss=removed><span xss=removed>တရားဝင်ဆောက်လုပ်ခွင့်ပြုမိန့်နဲ့ ဆောက်လုပ်ပြီးစီးသွားရင် ဘီစီစီလျောက်ရပါတယ်..။ </span></p><p xss=removed><span xss=removed>ဘုတ်စိမ်းစာရွက်တစ်ခုနဲ့တင် မပြီးပါဘူး..။ </span></p><p xss=removed><span xss=removed>ဘီစီစီစာရွက်ပါ ပါရပါတယ်..။</span></p><p xss=removed><span xss=removed>ဘုတ်စိမ်းစာရွက်(လူနေထိုင်ရန် လို့ ပါတဲ့စာရွက်)ပဲပြနိုင်ရင် တရားဝင် ဆောက်လုပ်ခွင့်နဲ့တော့ ဆောက်ထားတယ်..။</span></p><p xss=removed><span xss=removed> အဆောက်အဦးပြီးစီးကြောင်း စာရွက် ဘီစီစီတော့ တင်မထားဘူးလို့ အဓိပ်ပါယ်ရပါတယ်..။ </span></p><p xss=removed><span xss=removed>လှိုင်နဲ့ သင်္ဃန်းကျွန်း တစ်ချို့ရပ်ကွက်တွေမှာ ဘုတ်စိမ်း(ဆောက်လုပ်ခွင့်ပြုမိန့်) စာရွက်ပါပြီး..ဘီစီစီစာရွက်မပါတဲ့တိုက်တွေ တစ်ရပ်ကွက်လုံးနီးပါးရှိတဲ့ ရပ်ကွက်တစ်ချို့ရှိပါတယ်..။</span></p><p xss=removed><span xss=removed>ဘီစီစီစာရွက်ပါရင်တော့ ဘုတ်စိမ်းစာရွက်တောင်းဖို့ မလိုပါဘူး..။</span></p><p xss=removed><span xss=removed> ဘီစီစီဆိုတာ ဘုတ်စိမ်းစာရွက်ရှိမှ ရတဲ့စာရွက်မို့ပါ..။</span></p><p xss=removed><span xss=removed> တောင်ဥက္ကလာရဲ့ ၉၀%သောတိုက်ခန်းတွေက ဘီစီစီပါကြပါတယ်..။</span></p><p xss=removed><span xss=removed> တောင်ဥက္ကလာမှာ တရားမဝင်ဆောက်တဲ့တိုက်..၊ ဘီစီစီမတင်တဲ့တိုက် မရှိသလောက် နည်းပါတယ်..။(တစ်လုံးတစ်လေ ရှိပါတယ်..။)</span></p><p xss=removed><span xss=removed>၂၀၁၅ နှစ်လယ်ရှေ့ပိုင်းလောက်ထိ တိုက်တွေက မီတာကျပြီး အားလုံးပြီးစီးပြီဆိုမှ ဘီစီစီစာရွက် သပ်သပ်တင်ရတာပါ..။ </span></p><p xss=removed><span xss=removed>၃ထပ်ခွဲတိုက်နဲ့ ၅ထပ်တိုက်ဆောက်တဲ့ ကန်ထရိုက် အသေးစားတွေက ဆောက်လုပ်ခွင့်(ဘုတ်စိမ်း)တင်ပြီးဆောက်ရင် မီတာလည်း အလွယ်တကူရတာမို့ ဘီစီစီတင်တာကို အလုပ်ပိုလို့ မြင်ပါတယ်..။ <br></span></p><p xss=removed><span xss=removed>ဒါမို့လို့ ၃ထပ်ခွဲတိုက်နဲ့ ၅ထပ်တိုက်တွေမှာ ဘီစီစီစာရွက်မေးလိုက်ရင် လူနေထိုင်ရန်လို့ မင်အပြာနဲ့တုံးထုထားတဲ့ ဘုတ်စိမ်းစာရွက်ကို ဘီစီစီလို့ ပြောပြီးပေးတတ်တာလည်း ကြုံဖူးကြားဖူးပါတယ်..။<br></span></p><p xss=removed><span xss=removed>(မသိ နားမလည်တာကို အခွင့်အရေးယူတာပါ..။ ဒါမို့လို့ မိမိက သိအောင်လုပ်ထားရပါမယ်..။)<br></span></p><p xss=removed><span xss=removed>၂၀၁၅ နှစ်လယ်လောက်နောက်ပိုင်းကစလို့ အဆောက်အဦးတွေမှာ ဘီစီစီရမှ မီတာချပေးတော့ပါတယ်..။ <br></span></p><p xss=removed><span xss=removed>အဲဒီတော့မှ ဘယ်ကန်ထရိုက်တိုက်မဆို ဘီစီစီဆိုတာ မတင်မနေရ ဖြစ်ကုန်တာပါ..။<br></span></p><p xss=removed><span xss=removed>ဘီစီစီကျပြီးတာနဲ့ ဘီစီစီစာရွက်နဲ့ မီတာ ထပ်လျောက်ရပါတယ်..။</span></p><p xss=removed><span xss=removed>၂၀၁၅ နှစ်လယ်နောက်ပိုင်းကတိုက်တွေတိုင်းမှာ ဘီစီစီစာရွက် ပါပါတယ်..။</span></p><p xss=removed><span xss=removed><br></span></p><p xss=removed><span xss=removed>(ဘီစီစီကျပြီးမှ မီတာချပေးတော့တာမို့ ဘီစီစီမတင်ပဲ ချိုချိုချောင်ချောင်ဆောက်တဲ့ ၃ထပ်ခွဲနဲ့ ၅ထပ်တိုက်တွေ ဈေးမကိုက်တော့လို့ မဆောက်ကြတော့ပါဘူး..။)</span></p><p xss=removed><span xss=removed><br></span></p><p xss=removed><span xss=removed>တစ်ခါတုံးက တောင်ဥက္ကလာမှာ တိုက်ခန်းတစ်ခန်းရောင်းပေးတော့ စာရွက်စာတမ်းကို ရှေ့နေနဲ့စစ်တာကို အဆောက်အဦးပြီးစီးကြောင်း စာရွက်ပဲပါပြီး လူနေထိုင်ရန် ဆိုတဲ့ လူနေထိုင်ခွင့် ဘီစီစီစာရွက် လိုသေးတယ်လို့ အပြောခံရပါတယ်..။</span></p><p xss=removed><span xss=removed><br></span></p><p xss=removed><span xss=removed>(စိတ်ကို တော်တော်လေသွားပါတယ်..။) </span></p><p xss=removed><span xss=removed>ဘီစီစီရဲ့ အင်္ဂလိပ်အရှည်က Building Completion Certificate မို့ ဘီစီစီဆိုတာ လူနေထိုင်ခွင့်လို့ ရေးထားတဲ့ စာရွက်မဟုတ်ပဲ အဆောက်အဦးပြီးစီးကြောင်း အသိအမှတ်ပြုစာရွက်သာဖြစ်ကြောင်း အထောက်အထားခိုင်လုံစွာနဲ့ ရှင်းပြမှ လက်ခံသွားပါတော့တယ်..။<br></span></p><p xss=removed><span xss=removed>တိုက်ခန်းမဝယ်ခင် ဒီစာကို အသေးစိပ် နားလည်အောင်ဖတ်သွားရင် အကျိူးရှိပါတယ်..။<br></span></p><p xss=removed><span xss=removed>မိမိနဲ့ တိုက်ခန်းဝယ်ဖို့ရှိနေတဲ့ မိတ်ဆွေတွေကို ဒီပို့စ်ကို အဆင့်ဆင့်လက်ဆင့်ကမ်းပေးခြင်းဖြင့် မိမိစိတ်ထဲမှ မရှင်းလင်းမှုကို ချေဖျက်နိုင်ကြပါစေ..။<br></span></p><p xss=removed><span xss=removed>BCC စာရွက်မူရင်းပုံစံကိုတွဲလျက်ဖော်ပြပေးလိုက်ပါတယ်။</span></p><p xss=removed><b>#originalcredir</b><br></p>', '5e2d2fb40fe4088f77dd8da19456deae.jpg', 1, 1, '2021-07-29', 'July 29, 2021'),
(5, 'အိမ်ခြံမြေတိုက်ခန်း၀ယ်ယူရာတွင် ဘာကြောင့်သတင်းစာကြော်ငြာထည့်သင့်တာလဲ။', '<p><b>အိမ်ခြံမြေတိုက်ခန်း၀ယ်ယူရာတွင် ဘာကြောင့်သတင်းစာကြော်ငြာထည့်သင့်တာလဲ။</b></p><p>+++++++++++++++++++++++++++++++++++++</p><p><br></p><p>လွန်ခဲ့တဲ့ (၃)လလောက်ကပေါ့။ </p><p>ရန်ကုန်မြို့တွင်းက....</p><p>#ကွန်ဒိုတိုက်ခန်းကိုမှ ဝယ်ချင်ပါတယ်လို့ ဆိုလာသူ “ ကိုကောင်းစံ ” ရဲ့ ဆန္ဒကိုပါရမီဖြည့်ဖို့ အိမ်ခြံမြေအကျိုးဆောင်ကို ညီဇော်တို့ဇနီးမောင်နှံက အကျိုးဆောင်ချင်း ချိတ်ဆက်ပြီး ကြိုးစားရှာဖွေပေးကြပါတယ်။ ဒါနဲ့ ပန်းဘဲတန်းမြို့နယ်က ကွန်ဒိုပိုင်ရှင်တစ်ဦးနဲ့ ချိတ်ဆက်မိလို့ အိမ်ရာတစ်ခုကိုရောက်ခဲပါတယ်။</p><p><br></p><p><b><u>#အပြီးလက်ငင်းပေးချေဖို့တောင်းဆိုတဲ့ရောင်းသူ</u></b></p><p>ရောင်းမယ့် ကွန်ဒိုနှစ်ခန်းက ဘယ်ခန်း၊ ညာခန်း နှစ်ခန်းတွဲဖြစ်လို့ ကိုကောင်းစံက ပိုပြီးသဘောကျတယ်။ သိန်းတစ်ရာလောက်ပဲ စရန်ပေးပါရစေလို့ ပြောတော့ရောင်းသူက စရန်မလိုပါဘူး။ တစ်ခါတည်း အပြီးငွေချေတာ အကြိုက်ဆုံးပါ လို့ ပြောပါတယ်။ ဒါဆိုရင် (၁၀)ရက်လောက်တော့ ခေတ္တစောင့်ပါ။ သတင်းစာမှာ ကန့်ကွက်မယ်သူ ရှိမရှိ ကြော်ငြာကြည့်ချင်လို့ပါ။ တောင်ဆိုတဲ့အခါ ရောင်းသူကလည်း ခဏဆိုတော့ ခွင့်ပြုပါတယ်။<br></p><p><br></p><p><b>#စရန်ငွေတစ်ဝက်ပေးထားရတဲ့ဝယ်ယူသူ</b></p><p>ဒါနဲ့ ဝမ်းသာအားရ သတင်းစာမှာ ကြော်ငြာကြည့်တဲ့အခါမှာတော့ မထင်မှတ်ဘဲ ကန်ကွက်ချက်တွေ ပေါ်လာပါတော့တယ်။ တစ်ယောက်သောသူက A , B အခန်း (၂) ခန်း ရှိတဲ့အနက် A အခန်းကို သူတို့ဝယ်ထားတာတဲ့။ ပထမအရစ် တိုက်ခန်းတန်ဖိုးရဲ့ တစ်ဝက်ကိုပေးထားတဲ့ “ နှစ်ဦးသဘောတူ တိုက်ခန်းအရောင်းအဝယ် ကတိစာချုပ် (မူရင်း) ” ကို ထုတ်ပြပါတယ်။ သူထုတ်ပြတဲ့ စာချုပ်ကြည့်လိုက်တော့ အမှန်တကယ် ချုပ်ဆိုထားတဲ့ စာချုပ် ဖြစ်နေတယ်။ ဒါဆို ဒုတိယအရစ်ကျန်ငွေ မပေးဘဲ ဘာဖြစ်လို့ လက်ရောက် မယူခဲ့တာလဲလို့ မေးကြည့်တော့ ကျန်းမာရေးမကောင်းလို့ စင်ကာပူမှာ ဆေးကုသွားနေတာ (၃)လကြာသွားပါတယ်။ ပြန်လာတဲ့အခါကျတော့ (၃)လအထိ မစောင့်နိုင်လို့ အခု ကိုကောင်းစံတို့ကို ရောင်းမယ့်သူက ဝယ်သွားတယ်လို့ သိရပါတယ်။ အဲဒါ မူလပိုင်ရှင် ကန်ထရိုက်တာနဲ့ အဆက်ဆက် ဝယ်ထားသူတွေကို တိုင်းတရားရုံးမှာ တရားစွဲထားတယ်လို့ ပြောပြီး တရားမကြီးအမှုတွဲကို ထုတ်ပြပါတယ်။<br></p><p>ဟင် ဒါဆို အခုဝယ်မယ့် ကွန်ဒိုတိုက်ခန်းက ရှင်းရှင်းလင်းလင်း မဟုတ်ဘဲ ဖြစ်နေတာကို တွေ့ရပါတယ်။ စောစောစီးစီး နောက်ဆုတ်တာက အကောင်းဆုံးလို့ ဆုံးဖြတ်လိုက်ရတယ်။ ဒါပေမဲ့ ကန့်ကွက်ရက်က (၇)ရက် အပြည့်ပေးလို့နောက်တစ်နေ့မှာ စာပို့လုလင်တစ်ယောက်က နို့တစ်စာတစ်စောင်လာပို့ပြန်ပါတယ်။<br></p><p>ဝယ်သူထံက နို့တစ်စာ လာပြန်တာလဲလို့ဆိုတဲ့ အတွေးနဲ့ စာအိတ်ကို ဖောက်ဖက်ကြည့်လိုက်တဲ့အခါ သတင်းစာက ကန့်ကွက်ရန်ရှိမရှိ ကြော်ငြာနဲ့ ပတ်သက်ပြီး ရှေ့နေကြီးတစ်ဦးရဲ့ အသိပေး အကြောင်းကြားစာ ဖြစ်နေပါတယ်။<br></p><p><br></p><p><b>#နောက်တစ်ခါလာပြန်ပြီရှေ့နေကြီးရဲ့နို့တစ်စာ</b></p><p>သူရဲ့ အမှုသည်ကလည်း ကိုကောင်းစံကြော်ငြာတဲ့ တိုက်ခန်း(၂)ခန်းလုံးကို ဝယ်ထားတဲ့သူ ဖြစ်နေပြန်ပါတယ်။ သူက တော့ အခြားကန်ထရိုက်တာတစ်ဦးထံက ဝယ်ထားတယ်လို့ သိရပါတယ်။ ဒါဆိုရင် ဒီကွန်ဒိုတိုက်ခန်းတွေက ကန်ထရိုက်တာတစ်ဦးလည်း မဟုတ်ဘူးဆိုတာ သိလာရပြန်ပါတယ်။ ရှေ့နေကြီးက အသိပေးတဲ့အချက်ကတော့ ဒီတိုက်ခန်း (၂)ခန်း နဲ့ ပတ်သက်လို့ ရန်ကုန်တိုင်းဒေသကြီးတရားလွှတ်တော်ရုံးမှာ တရားမကြီးအမှုအမှတ် ( ) နဲ့ တရားစွဲပြီး သူပိုင်ငါပိုင်အငြင်းပွားနေတဲ့ တိုက်ခန်းတွေ ဖြစ်ပါတယ်။ လက်ရှိနစ်နာသူက ကန်ထရိုက်တာများ အပါအဝင် စာချုပ်အဆင့်ဆင့်ဖြင့် ဝယ်ယူပိုင်ဆိုင်ထားသူ (၉)ဦးခန့်ကို တရားပြိုင်ထားပြီး တရားစွဲဆိုထားတာလို့ဆိုပါတယ်။ ဒါကြောင့် ရှေ့နေကြီးက အမှုတန်းလန်းကြီးနဲ့ အဲဒီတိုက်ခန်းကို ဝယ်ခဲ့ရင် လူကြီးမင်းကိုလည်းတရားပြိုင် (၁၀)ယောက်နဲ့ နောက်တိုး တရားပြိုင်အဖြစ် တရားစွဲဆိုခြင်း ခံရပါလိမ့်မယ်လို့ မေတ္တာနဲ့ အသိပေးထားတာကို တွေ့ရပါတယ်။<br></p><p><br></p><p>ဟိုက်…. တော်ပါသေးရဲ့။ နို့တစ်စာနဲ့ အသိပေးတဲ့ ရှေ့နေကြီးကို အထူးကျေးဇူးတင်နေမိပါတယ်။ ဒါဟာ ကန့်ကွက်ရန် ရှိမရှိ သတင်းစာမှာ ကြော်ငြာမိလို့သာပေါ့။ နို့မဟုတ်ရင် အမှုတွဲမှာ ပါသွားပြီး တရားပြိုင်(၁၀)နဲ့ အမှုရင်ဆိုင်ရတော့မှာ ။ ဒါကြောင့် ပြောတာပေါ့ ။ အိမ်ခြံမြေတိုက်ခန်းတွေဝယ်ကြရင် ကန့်ကွက်ရန်ရှိမရှိ သတင်းစာကြော်ငြာသင့်ပါတယ်။ တကယ်လို့ ရှေ့နေငှါးရမ်းခ ဈေးကြီးတယ်ဆိုရင်လည်း မိမိအစီအစဉ်နဲ့ အခြားရှေ့နေတွေ ကြော်ငြာထားတဲ့ နမူနာယူပြီး မိမိနာမည်နဲ့ ကြော်ငြာရင်းhတွေ ဝယ်ရင် ကြေးမုံ ၊ မြန်မာ့အလင်း သတင်းစာမှာ ကြော်ငြာဖို့ မမေ့ပါနဲ့လို့အသိပေးတိုက်တွန်းလိုက်ရပါတယ်။</p><p><b>Credit: လွှတ်တော်ရှေ့နေမောင်ကောင်းဖေ<br></b></p><p><b>ကူးယူတင်ပြပါသည်။</b><br></p>', '22f1bb85e7a0821dd37c17456cdc4ca6.jpg', 1, 1, '2021-07-29', 'July 29, 2021'),
(6, 'အိမ်ခြံမြေ အမျိုးအစား အလိုက်စာရွက်စာတမ်း စစ်ဆေးရမည့် ပုံစံမျာ', '<h3 xss=removed><b><u>အိမ်ခြံမြေ အမျိုးအစား အလိုက်စာရွက်စာတမ်း စစ်ဆေးရမည့် ပုံစံမျာ</u></b>း</h3><p xss=removed><br></p><p xss=removed>', 'ef601072eb98f61278597eb0566cfbc9.jpg', 1, 1, '2021-07-29', 'July 29, 2021'),
(7, 'မြန်မာဓလေ့ထုံးတမ်း ဥပဒေအရ အမွေခွဲဝေပုံအခြေခံမူ (၄)ရပ်', '<h4><font color=\"#000000\" xss=removed><b><u>မြန်မာဓလေ့ထုံးတမ်းဥပဒေအရ<br></u></b></font><font color=\"#000000\" xss=removed><b><u>အမွေခွဲဝေပုံအခြေခံမူ (၄)ရပ်</u></b></font></h4><p>__________________________________</p><p>၁။ လင်သေလျှင် လင်၏ဥစ္စာပစ္စည်းအရပ်ရပ်ကို မယားက အမွေဆက်ခံရရှိသည်။ မယားသေလျှင် မယား၏ဥစ္စာပစ္စည်းအရပ်ရပ်ကို လင်က အမွေဆက်ခံရရှိသည်။  </p><p><br></p><p>၂။ အမွေခံထိုက်သူတို့ကိုရွေးချယ်ရာတွင် သွေးနီးသွေးဝေးကိုထောက်ချင့်ရခြင်း။သွေးနီးရှိကသွေးဝေးအမွေခံမထိုက်။</p><p><br></p><p>၃။ သွေးနီးသွေးဝေးစိစစ်ရာတွင် တစ်မိတည်းမှမွေးဖွားသူတို့သည် မိတူဖကွဲ ဖတူမိကွဲ မွေးဖွားသူတို့ထက် တစ်ဆင့်နီးသည်ဟု ယူဆရမည်။</p><p><br></p><p>၄။ အမွေသည်စုန်နိုင်လျှင်မဆန်စေရ။မစုန်နိုင်၍ဆန်ရလျှင်လည်းလိုသည်ထက်ပို၍ မဆန်စေရ</p><p>__________________________________</p><p>၁။ လင်သေလျှင် လင်၏ဥစ္စာပစ္စည်းအရပ်ရပ်ကို မယားက အမွေဆက်ခံရရှိသည်။ မယားသေလျှင် မယား၏ဥစ္စာပစ္စည်းအရပ်ရပ်ကို လင်က အမွေဆက်ခံရရှိသည်။  ကို ရှင်းလင်းခြင်း</p><p><br></p><p>@ လင်မယားနှစ်ဦးတွင် သြရသဝေစု ရယူပိုင်သည့် သားကြီး သမီးကြီးရှိလျှင် ကျန်ရစ်သူ လင် သို့မဟုတ် မယားက လင်မယားနှစ်ဦးပိုင်ပစ္စည်းအရပ်ရပ်၏ ၄ ပုံ ၃ပုံ ရရှိသည်။သြရသမှာ ကျန် ၄ပုံ ၁ပုံ ရရှိသည်။</p><p><br></p><p>@ ကျန်ရစ်သူ လင် သို့မဟုတ် မယားက အိမ်ထောင်အသစ်ထူထောင်လျှင် ပထမအိမ်ထောင်မှ သားသမီးတို့သည် လင်မယားနှစ်ဦးပိုင် ဥစ္စာပစ္စည်းအရပ်ရပ်၏ တစ်ဝက်ကို ထို သားသမီးများက တောင်းခံခွင့်ရှိသည်။</p><p><br></p><p>@ လင်သည်မယားတစ်ယောက်ထက်မကထားရှိ၍ ထိုမယားတို့အနက် တစ်ဦးဦးသည် လင် အရင် ကွယ်လွန်ခဲ့လျှင် ကွယ်လွန်သူမယား၏ သားသမီးတို့သည် ဖခင်ထံမှ မိမိတို့အမိ ပိုင်ဆိုင်ခွင့်ရှိသမျှကို အမွေအဖြစ်တောင်းခံနိုင်သည်။</p><p>[ ရန်ကုန်စီရင်ထုံး အတွဲ(၈) စာ - ၅၂၄ ]</p><p>__________________________________</p><p>၂။ အမွေခံထိုက်သူတို့ကိုရွေးချယ်ရာတွင် သွေးနီးသွေးဝေးကိုထောက်ချင့်ရခြင်း။သွေးနီးရှိကသွေးဝေးအမွေခံမထိုက်။ ကို ရှင်းလင်းခြင်း</p><p><br></p><p>@ သေသူ၏ အမွေကို ဖခင်၏နှမ နှင့် မိခင်ဖခင်နှစ်ဖက်လုံးမှတော်စပ်သည့် တစ်ဝမ်းကွဲ ညီအစ်ကိုမောင်နှမတို့ ယှဉ်ပြိုင်လုကြသည်။</p><p><br></p><p>*ဖခင်၏နှမ*</p><p>--------------------</p><p>သေသူမှမိဘသို့အဆန် - ၁ဆက်</p><p>မိဘမှဘိုးဘွားသို့အဆန် - ၁ဆက်</p><p>ဘိုးဘွားမှဦးကြီး ဦးလေးအစရှိသူများသို့အစုန် - ၁ဆက်</p><p><br></p><p>* မိခင်ဖခင်နှစ်ဖက်လုံးမှတော်စပ်သည့် တစ်ဝမ်းကွဲ ညီအစ်ကိုမောင်နှမ*</p><p>-----------------------------------</p><p>သေသူမှမိဘသို့အဆန် - ၁ဆက်</p><p>မိဘမှဘိုးဘွားသို့အဆန် - ၁ဆက်</p><p>ဘိုးဘွားမှဦးကြီး ဦးလေးအစရှိသူများသို့အစုန် - ၁ဆက်</p><p>ဦးကြီး ဦးလေးတို့မှ တစ်ဝမ်းကွဲညီအစ်ကိုမောင်နှမများသို့ အစုန် - ၁ဆက်</p><p><br></p><p>@ သွေးနီးသူမှ သွေးဝေးသူကိုထုတ်ပယ်သည့် အခြေခံမူအရ ဖခင်၏နှမ သည် တစ်ဝမ်းကွဲညီအစ်ကိုမောင်နှမများ ကို အမွေမှ ထုတ်ပယ်သည်။</p><p>[ ဦးဖေကြီး နှင့် ဦးပျိုး ရန်ကုန်စီရင်ထုံး အတွဲ(၃) စာ-၂၇၁ ]</p><p>__________________________________</p><p>၃။ သွေးနီးသွေးဝေးစိစစ်ရာတွင် တစ်မိတည်းမှမွေးဖွားသူတို့သည် မိတူဖကွဲ ဖတူမိကွဲ မွေးဖွားသူတို့ထက် တစ်ဆင့်နီးသည်ဟု ယူဆရမည်။</p><p>__________________________________ အမွေသည်စုန်နိုင်လျှင်မဆန်စေရ ကို ရှင်းလင်းခြင်း</p><p><br></p><p>@ အမွေသည်စုန်နိုင်လျှင် မဆန်စေရ အခြေခံမူအရ ကွယ်လွန်သူ၏ညီမများသည် ကွယ်လွန်သူ၏ အစ်ကိုဖြစ်သူကိုအမွေမှ ပယ်ထုတ်သည်။</p><p>[ လင်ကာဂင် နှင့် မစ္စစ်အိုင်းရစ် မောင်စိန် ၁၉၅၅ မတစ(တရားလွှတ်တော်ချုပ်).စာ - ၁၅ ]</p><p>__________________________________</p><p>မစုန်နိုင်၍ဆန်ရလျှင်လည်းလိုသည်ထက်ပို၍ မဆန်စေရ ကို ရှင်းလင်းခြင်း</p><p><br></p><p>@ သေသူ၏ဦးလေး နှင့် တူ တို့ယှဉ်ပြိုင်လုကြသည်</p><p><br></p><p>*ဦးလေး*</p><p>-------------</p><p>သေသူမှမိဘသို့အဆန် - ၁ဆက်</p><p>မိဘမှဘိုးဘွားသို့အဆန် - ၁ဆက်</p><p>ဘိုးဘွားမှဦးကြီး ဦးလေးအစရှိသူများသို့အစုန် - ၁ဆက်</p><p><br></p><p>*တူ*</p><p>-------</p><p>သေသူမှမိဘသို့အဆန် - ၁ဆက်</p><p>မိဘများမှညီအစ်ကိုမောင်နှများသို့ အစုန် - ၁ဆက်</p><p>ညီအစ်ကိုမောင်နှမများမှတူ တူမများသို့ အစုန် - ၁ဆက်</p><p><br></p><p>@ အမျိုး ၃ဆက်ဖြစ်၍ အနီးအဝေးတူနေသော်လည်း မစုန်နိုင်၍ဆန်ရလျှင်လည်းလိုသည်ထက်ပို၍ မဆန်စေရ အခြေံမူအရ တူ က တစ်ခါသာဆန်ရပြီး ဦးလေးသည် နှစ်ခါဆန်ရသဖြင့် သေဆုံးသူ၏တူသည် ဦးလေးကိုအမွေမှပယ်ထုတ်သည်။</p><p>[ မတင် နှင့် မရွှေဆင့် ရန်ကုန်စီရင်ထုံး အတွဲ(၄) စာ-၂၇ ]</p><p>Credit :U Ko Ko Aung </p><p xss=removed>ကူးယူဖော်ပြပါသည်။</p>', '85bf4feb3d1f23040b1ccd11d397a879.jpg', 1, 1, '2021-09-25', 'September 25, 2021');
